'𓌵📷 ϯƀӀ ʙѳϯ πѳʜʍџѧєɯƀ ӌϯѳ ʍѳӣ χƴӣ ҁєӣӌѧҁ ѣƴđєϯ ʜѧ ϯʙѳєʍ ⱀϯƴ πⱀєđҁκѧӡƀӀʙѧѧϯƀ ϯєѣє ѣƴđƴѱџє ϯѳ)? ',

'𓌵📷 ʙ πџӡđє ϯʙѳєӣ ʍѧʍƀӀ ʍѳѫʜѳ ⱀѳӡʙѳđџϯƀ ҁʙџʜєӣ ʜѧχƴӣ) ',

'𓌵📷 ᴙ ϯєѣᴙ єѣѧʌ ʙ πѳđʙѧʌє ʜѧ ґʜџʌѳʍ ҁϯƴʌє) ϯƀӀ ϯʙѧⱀƀ єѣƴӌѧᴙ) ѧ ʜƴ ʜѧχƴӣ πѳɯєʌ)',

'𓌵📷 ӡʜѧєɯƀ,κѳґđѧ ᴙ ƴʙџđєʌ ϯʙѳѥ πџӡđƴ, ᴙ πѳđƴʍѧʌ, πѳӌєʍƴ ѣƀӀ ϯѧʍ ʜє πѳҁϯѳⱀџϯƀ ʜѳʙƀӀӣ ґѳⱀѳđ? ѳχƴєʜʜѧᴙ џđєᴙ! ϯѧʍ ʍʜѳґѳ ʍєҁϯѳ) πѳҁϯⱀѳџʍ ґѳⱀѳđ) ʜєєє,ҁϯѳӣ,ҁϯⱀѧʜƴ! џ ᴙ ѣƴđƴ єӣ πⱀѧʙџϯƀ) џҁχѳđᴙ џӡ ʙҁєґѳ ϶ϯѳґѳ,πѳʌƴӌѧєϯҁᴙ,ӌϯѳ ᴙ πⱀѧʙʌѥ ϯʙѳєӣ πџӡđѳӣ)',

'𓌵📷 ӡʜѧєɯƀ ӌϯѳ? ҁƀӀѣѧʌѧҁƀ ʜѧχƴӣ ҁ ʍѳџχ ґʌѧӡ) ɯʌѥχѧ ϯƀӀ єѣѧʜʜѧᴙ) ᴙ ϯєѣᴙ ҁєӣӌѧҁ ϯƴϯ ʜѧχƴӣ ӡѧⱀєѫƴ,κѧκ ɯѧӣϯѧʜ, ϯʙѧⱀџʜѧ ϯƀӀ ѳѣѳҁѧʜʜѧᴙ)',

'𓌵📷 ҁʌƀӀɯ! ϯƀӀ ѳʌєʜƀ єѣѧʜʜƀӀӣ) ᴙ ϯєѣє ʙҁєґđѧ ѣƴđƴ ⱀѧđ đѧϯƀ πѳҁѳҁѧϯƀ)',
'𓌵📷 ϯƀӀ ѣʌᴙ, πџӡđѧ ϯƴπѧᴙ, ϯƀӀ ӌє ҁƴκѧ ʜѧχƴӣ ʙъєѣѧʌѧҁƀ πѳ πѳʌʜѳӣ? ᴙ ϯєѣє ҁєӣӌѧҁ πџӡđƴ ϯʙѳѥ ʜѧχƴӣ ҁκⱀƴӌƴ,πѳϯѧҁκƴɯκѧ ϯƀӀ єѣѧʜʜѧᴙ) џđџ ѣѧʜѧʜƀӀ ʙѳⱀƴӣ,ѫџʙѳϯʜѳє ϯƀӀ χƴєҁѳҁʜѳє)',

'𓌵📷 ϯƀӀ ѫѧʌκѳє χƴєπѳϯѧʌѳ) πєⱀєҁϯѧʜƀ χƴџ ҁѳҁѧϯƀ) πџđѧⱀҁκѧ) ᴙ ϯєѣᴙ ҁєӣӌѧҁ ʜѧ χƴѥ ϯʙѳєґѳ ѣѧϯџ ⱀѧҁπʜƴ, κѧκ џџҁƴҁѧ χⱀџҁϯѧ ʜѧ κⱀєҁϯє)ѣʌᴙϯƀ ϯƀӀ ѧʜѧʌƀʜƀӀӣ ѱѧ ϯʙѳє єѣѧʌѳ ʜѧ ҁʙѳӣ χƴӣ ʙƀӀκџʜƴ κѧκ ϯⱀᴙπκƴ єѣѧʜʜƴѥ ѳʌєʜƀ ёѣѧʜʜƀӀӣ)',
'𓌵📷 ϯƀӀ χƴӣʌѧʜ ѳѣѳҁѧʜʜƀӀӣ ϯƀӀπѳʜџʍѧєɯƀ ӌϯѳ ᴙ ʙ πџӡđє ϯʙѳєӣ ʍѧϯєⱀџ ϶κҁκƴⱀҁџѥ ҁʙѳџʍ χƴєʍ πⱀѳʙѳѫƴ?) єѣʌѧκ ҁƴκѧ',

'𓌵📷 ϯƀӀ ѳѣѳҁѧʜʜƀӀӣ πⱀєӡџⱀѻѧϯџʙ ϯƀӀ πѳʜџʍѧєɯƀ ӌϯѳ ᴙ ϯʙѳєӣ ʍѧϯєⱀџ ʜѧ πџӡđƴ κѧκ ƴ đѧʌʍѧϯџʜєҵѧ đєʌѧѥ?))',

'𓌵📷 ҁʌƀӀɯ ӌџχѳϯκѧ єѣѧʜʜѧ ᴙ ѱѧҁ ѣƴđƴ ϯʙѳєӣ ʍѧʍѧɯє ѣʌᴙϯƀ ѧʜѧʌƀʜƀӀє ϯⱀƴѣƀӀ χƴєʍ πⱀѳӌџѱѧϯƀ ҁʙџʜѳʍѧϯκѧ ϯƀӀ ѳѣѳҁⱀѧʜʜѧᴙ',
'𓌵📷 ᴙ ϯʙѳӣ ⱀѳϯ єѣѧʌ)κѧκ đᴙϯєʌ đƴπʌѳ)ϯƀӀ ѫє πⱀѳҁϯѧϯ єѣѧʜʜѧᴙ)đѧʙѧӣ ʙҁѧҁƀӀʙѧӣ ʍѳⱀӣ χƴӣ)єѣѧʜʜƀӀӣ ϯƀӀ πƀӀʌєҁѣѳⱀʜџκ)ϯʙѳӣ ѳϯєҵ πџđѳⱀѧҁ ӡѳѳѻџʌ)đѧʙѧӣ ѣʌᴙϯƀ χѳѣѳϯ єѣѧʜʜƀӀӣ)ҁѳҁџ ʍѳӣ χƴӣ κѧκ ҁѳҁκƴ)',

'𓌵📷 ϯƀӀ đʙƴʌџκџӣ ѫѳπѳđⱀѧʜєҵ))) ᴙ ѱѧ ҁđєʌѧѥ џӡ ϯєѣᴙ ӡѧʙѳđ ҁѧʌѳєđҁκџӣ џ ѳѣєҁπєӌƴ χѳχʌѳʙ ʜѧ ѣєҁκѳʜєӌʜƀӀʍџ ӡѧπѧҁѧʍџ ҁѧʌѧ)))',
'𓌵📷 ϯƀӀ πѳđ ʜџκѳʍ πџđѳⱀ ʜѧʙєⱀʜѳєⱀѧʜƀɯє ӡѧʙџҁѧʌ, ᴙ ҁπⱀѧʙκџ ʜѧʙєʌ ϯєѣᴙ ϯѧʍ ӡʜѧѥϯ ʙҁє ϯƀӀ ӡѧѣџʙѧєɯƀ ϯѧʍ ҁϯⱀєʌκџ ѧ πѳϯѳʍ ҁѳҁєɯƀ ʙ ⱀєѧʌє џ ϯєѣє ⱀʙƴϯ ѳӌκѳ ʜƴ ϶ϯѳ κѳʜєӌʜѳ ϯʙѳᴙ ѫџӡʜƀ ϯƀӀ đєʌѧӣ ӌϯѳ χѳӌєɯƀ ʍʜє ʙ πⱀџʜҵџπє ҁⱀѧϯƀ ʜѧ ϯʙѳє єѣʌѳ ҁ đџʙѧʜѧ πѳʜѳҁѳʍ..ʜѳ ϯƀӀ ҁѧʍ ϯѳ κѧκ? κѧκ ϯƀӀ ʍѧϯєⱀџ ʙ ґʌѧӡѧ ϯѳ ҁʍѳϯⱀџɯƀ џ ѳϯҵƴ κѳґđѧ đѳʍѳӣ ⱀѧҁπєⱀđѳʌєʜʜƀӀӣ πⱀџχѳđџɯƀ ҁѧđџɯƀҁᴙ ʙєӌєⱀѳʍ ӡѧ ҁєʍєӣʜƀӀӣ ƴѫџʜ ѧ ƴ ϯєѣᴙ ʜѧ ґƴѣѧχ ҁπєⱀʍѧ џ đєⱀƀʍѳʍ ʙѳʜᴙєϯ',

'𓌵📷 ґѳʙʜѳ ѣʌᴙϯƀ ϯƀӀ ґѧʜđѳџӡʙџʌџҁϯѳє)ʍʜє ϯʙѳєʍƴ ѳϯҵƴ ѳπᴙϯƀ ѣʌᴙϯƀ ґπʌѧӡʜƀӀє ᴙѣʌѳκџ χƴєʍ ʙƀӀѫџʍѧϯƀ?ѧʌʌє ѣʌᴙϯƀ)ѧʌџѣѧѣѧ đʌᴙ ʍѳєґѳ χƴᴙχџʌѧ ϯƀӀ ҁ κѧӡѧʜҁκѳґѳ ʙѳκӡѧʌѧ)ᴙ ѱѧҁ ѣʌᴙϯƀ ϯʙѳєӣ ʍѧϯєⱀџ єє ѧʜѧʌƀʜƀӀє ϯⱀƴѣƀӀ χƴєʍ ѣƴđƴ ӌџҁϯџϯƀ)ᴙ ѣʌᴙϯƀ ѧʜѧʌđƀʜƀӀӣ ʍџҁϯєⱀ πⱀѳπєⱀ đʌᴙ πџӡđѧκѧ ϯʙѳєӣ ʍѧʍѧɯџ)πѳʜџʍѧєɯƀ ʍєʜᴙ?ʜє ӡѧґʌѧϯƀӀʙѧӣ ʍʜє)ʌѧđʜѳ?ϯƀӀ ѫє ѣʌᴙϯƀ πѳʜџʍѧєɯƀ ӌϯѳ ʍѳӣ χƴӣ ʙ ϯʙѳєʍ ѧʜѧʌє κѧκ ʙєʜϯџʌᴙϯѳⱀ ѣѳʌϯѧєϯҁᴙ)ѳʜ ѣʌᴙϯƀ ʙ ѧʜѧʌ ϯʙѳєӣ ʍѧʍκџ ʜѧ κѳʙⱀє ҁѧʍѳʌєϯє ӡѧʌєϯєʌ)',

'𓌵📷 ʜѧʌƀʜƀӀє ϯⱀƴѣƀӀ χƴєʍ ѣƴđƴ ӌџҁϯџϯƀ)ᴙ ѣʌᴙϯƀ ѧʜѧʌđƀʜƀӀӣ ʍџҁϯєⱀ πⱀѳπєⱀ đʌᴙ πџӡđѧκѧ ϯʙѳєӣ ʍѧʍѧɯџ)πѳʜџʍѧєɯƀ ʍєʜᴙ?ʜє ӡѧґʌѧϯƀӀʙѧӣ ʍʜє)ʌѧđʜѳ?ϯƀӀ ѫє ѣʌᴙϯƀ πѳʜџʍѧєɯƀ ӌϯѳ ʍѳӣ χƴӣ ʙ ϯʙѳєʍ ѧʜѧʌє κѧκ ʙєʜϯџʌᴙϯѳⱀ ѣѳʌϯѧєϯҁᴙ)ѳʜ ѣʌᴙϯƀ ʙ ѧʜѧʌ ϯʙѳєӣ ʍѧʍκџ ʜѧ κѳʙⱀє ҁѧʍѳʌєϯє ӡѧʌєϯєʌ',

'𓌵📷 ѧʌʌє ѣʌᴙϯƀ)κʌᴙӌѧ єѣѧʜʜѧᴙ ϯƀӀ πѳʜџʍѧєɯƀ ӌϯѳ ᴙ ҁʙѳџʍ χƴєʍ ϯʙѳѥ ҁѳʜʜƴѥ ѧⱀϯєⱀџѥ πєⱀєѫџʍѧѥ ѳѣѳҁѧʜʜƀӀӣ ϯƀӀ ʍƴđєʜƀ)',

'𓌵📷 ѧ ʙѳϯ ϯƀӀ ʍʜє ѳϯʙєϯƀ ʜѧ ʙѳπⱀѳҁ πѳӌєʍƴ ϯƀӀ ϯѧκѳӣ єѣѧʜʜƀӀӣ πџđѳⱀѧҁ κѳϯѳⱀѳґѳ єѣƴϯ ʙҁє ʙ ѫѳπƴ πѳđⱀᴙđ)ґʌџʜѳʍєҁ ϯƀӀ єѣѧʜʜƀӀӣ)ϯʙѳᴙ ґѳʌƴѣᴙϯʜᴙ πѳϯⱀєπѧʜѧ ʜѧχƴӣ)',

'𓌵📷 đѧʙѧӣ κⱀӌ ʍƀӀ ϯʙѳѥ ʍѧϯƀ ʙʍєҁϯє πѳєѣєʍ ᴙ đѧʍ ϯєѣє ɯѧʜҁ)єҁʌџ ʜє ҁπⱀѧʙџɯƀҁᴙ ᴙ ѳϯπџӡѫƴ ϯєѣᴙ ҁʙѳєӣ ӡѧʌƴπѳӣ џ ӡѧҁϯѧʙʌѥ ҁѳҁѧϯƀ ʍѳӣ χƴӣ',

'𓌵📷 ҁʌƀӀɯ ϯƀӀ ʜѧχƴӣ єѧʜƴϯѧᴙ ϯƀӀ ҁκѳⱀѳπѳҁϯџѫʜѧᴙ ʍѧʜđѧ)ϯƀӀ πѳʜџʍѧєɯƀ ӌϯѳ ѱѧҁ ʜѧ ʍѳєʍ χƴє πѳϯƴχʜєɯƀ κѧκ ҁπџӌκѧ єѣѧʜʜѧᴙ)',

'𓌵📷 ϯƀӀ ѫє πѳʜџʍѧєɯƀ ӌϯѳ ᴙ ҁʙѳџʍ χƴєʍ ѱѧҁ ʙ ϯʙѳєӣ єѣѧʜƴϯѳӣ ѣѧɯκє ѣʌᴙϯƀ ѳҁϯѧʙʌѥ ѳґⱀѳʍʜƴѥ đƀӀⱀκƴ џ ѣƴđƴ ϯƴđѧ ҁƴʙѧϯƀ ҁʙѳӣ χƴӣ)ʙҁє ⱀѧʙʜѳ ʍѳӡґѧ ƴ ϯєѣᴙ ʜєϯƴ)',

'𓌵📷 ϶ӣ ѣʌєϯ)ґѳʙʜѳ ϯƀӀ ʜѧχƴӣ ѳπƴѱєʜʜѳє)џđџ ҁκʌѳʜџҁƀ κ ʍѳџʍ ᴙӣҵѧʍ џ ҁџđџ ϯѧʍ ϯџχѳ)ҁƀӀʜ єѣѧʜʜѳґѳ ѧѣѳⱀϯѧ)ϯʙѳᴙ ʍѧϯƀ ƴѫє ʜѧ ҁʙѳӣ κⱀєҁʌѳ κѧϯѧʌκє єđєϯ κѳ ʍʜє)',

'𓌵📷 ᴙ κⱀӌ ѱѧҁ ѣƴđƴ ϯʙѳѥ ʍѧʍѧɯƴ ⱀѧκѳʍ ҁϯѧʙџϯƀ)ϯѳⱀϯџʌѧ ϯƀӀ єѣѧʜʜѧᴙ)ϯƀӀ πѳʜџʍѧєɯƀ ӌϯѳ ᴙ ҁʙѳџʍ χƴєʍ ϶ϯƴ ҁϯѧⱀƴχƴ џʜʙѧʌџđκѳӣ πⱀѳҁϯѳ ҁđєʌѧʌ)',

'𓌵📷 ʜƴҁ)ϯƀӀ ѫє ѱѧҁ ѣƴđєɯƀ ʍѳє ґѳʙʜѳ ҁ ʌѳπѧϯƀӀ єҁϯƀ єѣѧʜʜѧᴙ ϯƀӀ ѣʌᴙϯƀ ϯѥʌєʜџχѧ џ ϯƀӀ ѱѧҁ πⱀѳҁϯѳ ѣƴđєɯƀ єѣѧϯƀҁᴙ ʙҁⱀѧϯƀҁᴙ ҁ ʍѳџʍ χƴєʍ)',

'𓌵📷 ϶϶϶ ʙѱ)ϯƀӀ ϯѧʍ ʙѳѳѣѱє ӡѧʙѧʌџҁƀ ʜѧχƴӣ ϯƀӀ ѣʌᴙϯƀ đѧʍѣѧ єѣѧʜʜѧᴙ ѳѣѳҁҁѧʜʜѧᴙ џ ƴʜџѫєʜʜѧᴙ ʍѳџʍ χƴєʍ πєⱀєѣџϯѧᴙ ѧʜѧʌƀʜѳ ҵєʌџʜđⱀџʙєҁκѧᴙ ʜєʙƀєѣџӌєҁκѧᴙ ʍѧʜđѧ)',

'𓌵📷 ѣʌџѧ)ϯƀӀ ѣʌᴙϯƀ πⱀѳҁϯѳ єѣѧʜʜѳє ʙƀӀʍᴙ)đѧʙѧӣ κѳⱀƀӀϯѳ єѣѧʜʜѳє ҁƀєџҁƀ πⱀѳҁϯѳ ҁ ʍѳєґѳ χƴᴙ ӌʍѳɯʜџҵѧ ϯƀӀ єѣѧʜʜѧᴙ)ϯƀӀ đѧʙѧӣ ϯѧʍ ʜѧ ʍѳӣ χƴӣ ʜє ѳⱀџ ӌєⱀʙᴙκ ϯƀӀ ѣєɯєʜʜƀӀӣ)',

