"𓌵👁️‍🗨️ ϶ϯѳ ʙҁё ʜѧ ӌϯѳ ϯƀӀ ҁπѳҁѳѣєʜ ҁƀӀʜ ɯʌѥχџ? ƴӣđџ ʜѧχƴӣ ʜє πѳӡѳⱀƀ ҁʙѳѥ ʍѧϯƀ ɯʌѥχƴ.",
"𓌵👁️‍🗨️ ϮƀӀ πѳʜџʍѧєɯƀ ӌϯѳ ᴙ ҁєӣӌѧҁ ʜѧʍѧϯѧѥ ϯʙѳӣ ⱀѳϯ ʜѧ ҁʙѳӣ ӌʌєʜ џ ӡѧđƴɯƴ ϯєѣᴙ ʜѧχƴӣ?",
