"𓌵👁️‍🗨️ ϮƀӀ πѳʜџʍѧєɯƀ, ӌϯѳ κʌџϯѳⱀ ϯʙѳєӣ ʍѧϯєⱀџ ϶ϯѳ ӌⱀєӡʙƀӀӌѧӣʜѳ ѳπѧҁʜѧᴙ ӡѳʜѧ?",
