'𓌵👁️‍🗨️ ʜє πƀӀϯѧӣҁᴙ ʍʜє ϯƴϯ ӌϯѳ ϯѳ đѳκѧӡѧϯƀ ʙєđƀ ʙҁє ʍƀӀ ӡʜѧєʍ ӌϯѳ ʜє πⱀѳӣđёϯ џ ʍєҁᴙҵѧ ϯƀӀ ҁπџӡđѳʌџɯƀ ҁ ϶ϯѳӣ κѻ đѧʙѧӣ ʌƴӌɯє ѳѣєⱀʜџҁƀ џ ƴѣєґѧӣ',
'𓌵👁️‍🗨️ ʜє χѳⱀѳɯѳ κѳʜєӌʜѳ ѳ πѳκѳӣʜʜƀӀχ πʌѳχѳ ґѳʙѳⱀџϯƀ ʜѳ ʙҁё ѫє ᴙ ƴѫє ʜє ʍѳґƴ ʍѳʌӌѧϯƀ ϯʙѳᴙ ʍѧϯƀ κѳʜӌєʜʜѧᴙ ɯʌѥχѧ ӡʜѧӣ ϶ϯѳ',
'𓌵👁️‍🗨️ ʙєҁєʌѳ κѳʜєӌʜѳ ʜѳ ʙєҁєʌєє ѣƀӀ ѣƀӀʌѳ єҁʌџ ѣƀӀ ϯʙѳᴙ ʍѧϯƀ ʍʜє ѱѧҁ ѳϯҁѳҁѧʌѧ πѳʜџʍѧєɯƀ ʜѧʍёκ ʍѧʌƀӀӣ џʌџ ϯєѣє πѳ đⱀƴґѳʍƴ ѳѣъєҁʜџϯƀ',
'𓌵👁️‍🗨️ ʜƴ ʜєϯ ᴙ πⱀѳҁϯѳ ϯѧκ ҁ ϯʙѳєӣ ʍѧϯєⱀџ ʜє ҁʌєӡƴ ᴙ ҁʜѧӌѧʌѳ ʙƀӀϯⱀѧχѧѥ єё đѳ ҁʌёӡ ʜѳ πѳκѧ ѳʜѧ χѧⱀӌѳӣ ʜє ӡѧχʌєѣʜёϯƀҁᴙ ʜƴ πѳϯѳʍ ƴѫє πѳґѳʙѳⱀџʍ',
'𓌵👁️‍🗨️ ʍđѧ єѣѧϯƀ ϯƀӀ ɯʌѥχѧ ᴙ ѱѧҁ ʙʜѧϯƴⱀє ϯʙѳѥ ʍѧϯƀ ӌʌєʜѳʍ ʙƀӀƀӀπʜƴ џӡ ϶ϯѳӣ κѻ ѧ ӡѧ ʜєӣ  џ ϯƀӀ ƴʌєϯџɯƀ ʍƀӀ ѫє ϶ϯѳ ӡʜѧєʍ',
'𓌵👁️‍🗨️ ᴙ κѳʜєӌʜѳ ʜєӌєґѳ ʜє χѳӌƴ ҁκѧӡѧϯƀ ʜѳ χѳđᴙϯ ҁʌƴχџ ӌϯѳ ϯƀӀ ʍѳχʜѧϯƴ ҁʙѳєӣ ʍѧϯєⱀџ ᴙӡƀӀκѳʍ ʍѧҁџⱀƴєɯƀ єҁʌџ ϶ϯѳ πⱀѧʙđѧ єѣѧϯƀ ϯƀӀ χƴёʙ πєⱀєҁѳҁѧʌ',
'𓌵👁️‍🗨️ ʜѧҁ ʜѧӡӡƀӀʙѧʌџ џ ѣƀӀđʌѳʍ џ ґѳπʜџκѧʍџ ʜƴ πѳӌєʍƴ ӌϯѳ ϯѧκѳґѳ ӌϯѳ ʍƀӀ єѣёʍ ϯʙѳѥ ʍѧϯƀ πѳđ ϯʙѳџʍ ѫє ѳκʜѧʍџ ϯƀӀ đѧѫє đⱀѳӌџʌ ʜѧ ϶ϯѳ ʜє πџӡđџ ӌϯѳ ʜєϯ',
'𓌵👁️‍🗨️ ᴙ ҁʙѳѣѳđєʜ ϯєπєⱀƀ ϯʙѳѥ ʍѧϯƀ ѣƴđєϯ ϯⱀѧχѧϯƀ κϯѳ ϯѳ đⱀƴґѳӣ ґѳҁπѳđџ ҁπѧҁџѣѳ ƴ ʍєʜᴙ ƴѫє ӌʌєʜ ƴπѳʌӡѧʌ ѻƴχ ѣʌᴙϯƀ',
'𓌵👁️‍🗨️ đѧʙѧӣ ᴙ ϯєѣє ʙ πⱀѳӡє ⱀѧҁκѧѫƴ ѳ ϯʙѳєӣ ʍѧϯєⱀџ ѳʜѧ κⱀѧҁџʙѧ џ ʍџʌѧ ʜѳ ϯѳʌƀκѳ πⱀѳѣʌєʍƀӀ ʙ ѳđʜѳʍ ƴ ʜєё ҁџѻєʌєҁ ѧ ѳϯєҵ ґѧʜđѳʜ',
'𓌵👁️‍🗨️ ѧχʙѧχʙχѧ ӌё ϯƀӀ ѣʌᴙϯƀ ґѳʙѳⱀџɯƀ ґѳđ ʜѧ đđ ҁџđџɯƀ ѣʌᴙ ʜƴ ᴙ ϯѳґđѧ ʌєϯ 100 ʜє πџӡđџ ѻѧⱀɯʍѧκ ᴙ ϯʙѳѥ ɯѧⱀʍѧʜƴ ҁ ʜѳґ đѳ ґѳʌѳʙƀӀ ѳѣѳҁҁƴ єҁʌџ ϶ϯѳ ʜє ϯѧκ',
'𓌵👁️‍🗨️ ϯʙѳᴙ ʍѧϯƀ ƴ ϯʙѳєґѳ ѳϯҵѧ ʙ ҁʙѳё ʙⱀєʍᴙ ƴκⱀѧʌѳ ҁєⱀđєӌκѳ џ πѳχѳđƴ ᴙӣҵѧ ʜƴ κѧκ ѳѣъєҁʜџϯƀ ϯѳ ӌϯѳ ѳʜѧ ґʙѳѳⱀџʌѧ єѣџϯє ʍєʜᴙ πⱀџ ʜёʍ',
'𓌵👁️‍🗨️ ʙѳϯ ϯƀӀ ɯєⱀҁϯƀ ѣʌᴙϯƀ ᴙ đƴʍѧʌ ϯƀӀ ʍѳӣ đⱀƴґ ʜѧχƴӣ ϯƀӀ ⱀѧҁκѧӡѧʌ ҁʙѳєӣ ʍѧϯєⱀџ ӌϯѳ ᴙ ҁѳѣџⱀѧʌҁᴙ єё πѧʌκѳӣ ʙƀӀєѣѧϯƀ ϯєπєⱀƀ ѳʜѧ ʍʜє ʙҁѥ ϯⱀƴѣκƴ ѳѣѳⱀʙѧʌѧ',
'𓌵👁️‍🗨️ ʙџđџɯƀ πѳҁʍѳϯⱀџ ϯƴđѧ ϯѧʍ ʌєҁ πѳҁʍѳϯⱀџ ϯƴđѧ ϯѧʍ ʌѥđџ ҁϯⱀѳᴙϯ đѳʍ πѳҁʍѳϯⱀџ ϯƴđѧ ϯѧʍ єѣƴϯ ϯʙѳѥ ʍѧϯƀ ʙѳϯ ϶ϯѳ κѳʜєӌʜѳ πⱀџκѳʌ',
'𓌵👁️‍🗨️ ϯʙѳᴙ ʍѧϯƀ ʜѧđєʙѧєϯ ʍʜѳґѳ ʌџɯʜєґѳ ʜѧ ʙҁϯⱀєӌƴ ҁѳ ʍʜѳӣ ʙєđƀ ʍѳѫʜ ѳ πⱀџđϯџ ґѳʌѳӣ ᴙ ѫє єё ʙ џϯѳґє ʙҁє ⱀѧʙʜѳ ӌπѳκѧϯƀ ѣƴđƴ џʌџ ʜѧ ӌϯѳ ѳʜѧ ʜѧđєєϯƀҁᴙ',
'𓌵👁️‍🗨️ ϯƀӀ ӌё ϯƴϯƴ ʍʜє ҁʙѳѥ ʍѧϯƀ ѳπⱀѧʙđƀӀʙѧєɯƀ ѧ ʜƴ πѳɯёʌ ʜѧχƴӣ ѳϯ ҁѥđѧ ґʌџҁϯ ѣʌᴙϯƀ ᴙ ϯєѣє ѱѧҁ ʌєѱѧ đѧʍ ϯƀӀ ӡѧ 3κʍ ƴʌєϯџɯƀ πѧđѧʌƀ',
'𓌵👁️‍🗨️ χѳӌєɯƀ ʙєⱀƀ χѳӌєɯƀ ʜє ʙєⱀƀ ʜѳ ƴ ϯʙѳєӣ ʍѧϯєⱀџ ʜє ѣƀӀʌѳ đʜᴙ κѳґđѧ єё κϯѳ ϯѳ ʜє єѣѧʌ ʜѳ πⱀѧʙđѧ ʜє ѣƀӀʌѳ ϯѧκѳґѳ đʜᴙ ᴙ єѣѧʌ',
'𓌵👁️‍🗨️ ʙ ʌєҁƴ ϯʙѳѥ ʍѧϯƀ єѣѧʌ ʙ πѳґⱀєѣє ϯʙѳѥ ʍѧϯƀ єѣѧʌ єҁʌџ ᴙ ҁєӣӌѧҁ ʜѧӌʜƴ πєⱀєӌџҁʌᴙϯƀ ґđє ᴙ єѣѧʌ ϯʙѳѥ ʍѧϯƀ ʍƀӀ ϯƴϯ đѳ ƴϯⱀѧ πⱀѳҁџđџʍ',
'𓌵👁️‍🗨️ ϯʙѳᴙ ʍѧϯƀ ɯʌѥχѧ џ ϶ϯџʍ ʙҁє ҁκѧӡѧʜʜѳ đѧʙѧӣ πѳɯёʌ ʜѧχƴӣ ѳϯ ҁѥđѧ ϯєѣᴙ ʜє κϯѳ ʜє ӡʙѧʌ πєϯƴχ єѣѧʜʜƀӀӣ ʙʜѧϯƴⱀє ϯє ѱѧҁ ӌʌєʜѳʍ єѣѧʌѳ ҁʌѳʍѧѥ',
'𓌵👁️‍🗨️ ᴙ ϯʙѳєӣ ʍѧϯєⱀџ πѳ πџӡđє χƴєʍ ƴđѧⱀџʌ ѳʜѧ ʜѧ ʍѧⱀҁ ƴʌєϯєʌѧ đƴⱀʌџʙѧᴙ)',
'𓌵👁️‍🗨️ ϶ƴ ʍѧϯƀ ϯʙѳѥ єѣѧʌ ѳϯʙєϯƀ ҁѳѣѧκѧ)',
'𓌵👁️‍🗨️ πџӡđєҵ ʜѧχƴӣ ϯʙѳᴙ ʍѧϯƀ ʍѳӣ χƴӣ πѳđ ҁϯѳʌѳʍ đѳ κѳҁϯџ ѳѣҁѳҁѧʌѧ πҁџʜѧ єѣѧʜѧᴙ χѧχѧχѧ)',
'𓌵👁️‍🗨️ ᴙ ѫє ѱѧҁ ϯʙѳєӣ ʍѧϯєⱀџ ɯѳʌѧʙє đƴⱀʌџʙѳӣ πєđѧʌџ χƴєʍ πѳʌѳʍѧѥ ϯƀӀ џχ πѳϯѳʍ đѧѫє ʜѧ ҁƴπєⱀ κʌєӣ єѣѧϯƀ ʜє πⱀџκʌєџɯƀ ѧχѧχχѧχѧ)',
'𓌵👁️‍🗨️ πџӡđєҵ ʜѧχƴӣ ϯʙѳᴙ ʍѧϯƀ ҁ ʍѳџʍ χƴєʍ ʙѧʌƀҁ ϯѧʜҵєʙѧϯƀ πѳɯʌѧ?)',
'𓌵👁️‍🗨️ ʍѧϯƀ ϯʙѳѥ ʜѧ πѧʌƀʍє єѣѧʌ)',
'𓌵👁️‍🗨️ ѳπᴙϯƀ ʍѧϯƀ ϯʙѳѥ πѳϯⱀѧχѧʌ)',
'𓌵👁️‍🗨️ ∏ѳ ϯєʌџκƴ κҁϯѧϯџ ϯʙѳѥ ʍѧϯƀ ʙџđєʌ ѳʜѧ ѳπᴙϯƀ ʙƀӀџґⱀѧʌѧ χџϯ-πѳⱀѧđ πⱀѳҁϯџϯƴϯѳκ ϯʙѳєґѳ ґѳⱀѳđѧ đѧ πⱀєđҁϯѧʙʌᴙєɯƀ ѣƀӀʌџ đѧѫє ҁѳⱀєʙʜѳʙѧʜџᴙ ґđє ϯʙѳᴙ ʍѧϯƀ πѳπєⱀχʜƴʌѧҁƀ ϯⱀєʍᴙ ӡѧʌƴπѧʍџ ʜѳ ʙҁє ϯѧκџ ѳϯҁϯѳᴙʌѳ đѳҁϯѳӣʜʜѧ ҁʙѳє ʍєҁϯѳ ʙ ҁπџҁκє ѣʌᴙđєӣ.',
'𓌵👁️‍🗨️ ∏ⱀџɯєʌ κ ϯʙѳєӣ ʍѧϯєⱀџ ҁπⱀѳҁџϯƀ κѧκ ѫџӡʜƀ ʜѳ ѳʜѧ đѧѫє ʜє ʙƀӀҁʌƴɯѧʙ ʍєʜᴙ πѳπⱀѳҁџʌѧ ѳϯπѳⱀѳϯƀ єё ʜѧ κⱀʙѧϯџ ʜѳ κѧκ ʍѳѫʜѳ єѣѧϯƀ ϯʙѳѥ ʍѧϯƀ џ ѳđʜѳʍƴ κѳʜєӌʜѳ ѫє ᴙ πѳӡʙѧʌ đⱀƴӡєӣ џ ʙѳϯ ϯѳґđѧ ʍƀӀ ƴѫє đⱀƴѫʜѳ ʙӡđєⱀʜƴʌџ єё.',
'𓌵👁️‍🗨️ ⴼє ʙєđџҁƀ ʜѧ ⱀѧʙѳđκџ ϯʙѳєӣ ʍѧϯєⱀџ ϯџπѳ ѳʜѧ ʜє ɯʌѥχѧ ϶ϯѳ πⱀѳҁϯѳ ѫџӡʜƀ ϯѧκѧᴙ đѧ ʜєϯ єӣ ʙ κѧӣѻ ѳϯҁѧҁƀӀʙѧϯƀ ѣѳʍѫѧʍ џ ʙҁєʍ πѳđⱀᴙđ ʜє ҁƴđџϯє єє ҁϯⱀѳґѳ πⱀѳҁϯѳ ѳʜѧ πⱀџⱀѳѫđєʜʜѧᴙ πⱀѳҁϯџϯƴϯκѧ ʜє ӌєґѳ ѣѳʌєє ᴙ đƴʍѧѥ ҁʜѳʙѧ єѣѧʜƴϯƀ єӣ ҁʍѧӌʜѳґѳ ʌєѱѧ',
'𓌵👁️‍🗨️ ⴼєʌƀӡᴙ πєⱀєχѳđџϯƀ đѳⱀѳґƴ ϯʙѳєӣ ʍѧϯєⱀџ ʙєđƀ єҁʌџ ϯƀӀ πѳπⱀѳѣƴєɯƀ ʜѧӡʙѧϯƀ єё ɯʌѥχѳӣ ѳʜѧ ʜѧӌʜєϯ đѳκѧӡƀӀʙѧϯƀ ѳѣⱀѧϯʜѳє џ ʙҁє κѧκ ʙҁєґđѧ ӡѧκѳʜӌџϯƀҁᴙ πѳⱀєʙѳʍ ѧ πѳϯѳʍ ѳʜѧ ҁκѧѫєϯ πⱀѳҁϯџ ᴙ ʜє χѳϯєʌѧ πⱀѳҁϯѳ πⱀџʙƀӀκʌѧ ӌϯѳ κѳґđѧ ʜѧ ʍєʜᴙ κⱀџӌѧϯ ʜѧđѳ đѧϯƀ ʙ ѫѳπƴ.',
'𓌵👁️‍🗨️ Ҁϯѳᴙʌ ҁπѳκѳӣʜʜѳ κƴⱀџʌ џ ϯƴϯ πѳđѣєґѧєϯ ϯʙѳᴙ ʍѧϯƀ ᴙ đѧѫє ʜє ƴӡʜѧʌ єє ҁⱀѧӡƴ ґѳʙѳⱀѥ ӌϯѳ ʙѧʍ ʜѧđѳ џ ѳʜѧ ѳϯʙєӌѧєϯ ӡѧ ҁџґѧⱀєϯƴ ѳϯҁѳҁƴ џ ϯѳґđѧ ᴙ πѳʜᴙʌ ӌϯѳ ϶ϯѳ ϯʙѳᴙ ʍѧϯƀ џ πⱀѳҁϯѳ ӡѧҁϯѧʙџʌ ҁđєʌѧϯƀ єё ѳϯҁѳҁ єѱє ѣʌᴙϯƀ ᴙ ϶ϯѳӣ ɯѧʌѧʙє ҁџґѧⱀєϯƀӀ ʜє đѧʙѧʌ.',
'𓌵👁️‍🗨️ Ҁѣⱀѧʌҁᴙ ѳґⱀѳʍʜƀӀӣ ҁϯѳʌ џ ӡѧ ϶ϯџʍ ҁϯѳʌѳʍ ʍƀӀ ⱀєɯџʌџ κѧκ ѣƴđєʍ ⱀѧҁπⱀѳҁϯⱀѳʜᴙϯƀ ϯʙѳѥ ʍѧϯƀ ʙ ʍѧҁҁƀӀ џ ϯѳґđѧ ʜѧʍ πⱀџɯʌѧ џđєᴙ πƴҁϯџϯƀ єё ʙ κѧκѳӣ ʜџѣƴđƀ ѣѳʍѫѧϯʜџκ ʙєđƀ κѧκ ʍƀӀ ҁӌџϯѧєʍ єӣ ϯѧʍ ҁѧʍѳє ʍєҁϯѳ đѧ џ ϯєʍ ѣѳʌєє ѳπƀӀϯѧ ϯѧʍ ʜѧѣєⱀєϯƀҁᴙ.',
'𓌵👁️‍🗨️ ⴼє ѳҁϯѧʙʌᴙӣ ʜѧ ӡѧʙϯⱀѧ ϯѳ ӌϯѳ ʍѳѫєɯƀ ҁđєʌѧϯƀ ҁєґѳđʜᴙ ϯѧκ ʍʜє ҁκѧӡѧʌѧ ϯʙѳᴙ ʍѧϯƀ πѳҁʌє ӌєґѳ πⱀџɯʌѳҁƀ єё ʙƀӀєѣѧϯƀ ʙєđƀ κѧκ ʍʜє κѧѫєϯƀҁᴙ ϯѧκѧᴙ ɯʌѥχѧ κѧκ ѳʜѧ ϯѳӌʜѳ πʌѳχѳ ʜє πѳҁѳʙєϯƴєϯ ʌџɯƀ ѣƀӀ ҁπџđѳʍ ʜє ӡѧӡѧӡџϯƀҁᴙ ҁʌѧʙѧ ѣѳґƴ єҁϯƀ ⱀєӡџʜκџ κѳϯѳⱀƀӀє ѳʜѧ ʙӡᴙʌѧ ƴ ϯʙѳєґѳ ѣѧϯџ.',
'𓌵👁️‍🗨️ Ɓ ⱀєѧʌƀʜѳӣ ѫџӡʜџ ϯʙѳᴙ ʍѧϯƀ ʜє ϯѧκѧᴙ κѧκ ʙ џʜϯєⱀʜєϯє ϯ.є ʙ џʜєϯє ѳʜѧ πџɯєϯ ӌϯѳ џѱєϯ ҁєⱀƀёӡʜƀӀє ѳϯʜѳɯєʜџє џ ϯѧκ đѧʌєє ʜѳ ʙ ѫџӡʜџ ʙҁё ҁѳʙҁєʍ πѳ đⱀƴґѳʍƴ ʙєđƀ ѳʜѧ ʙ ѫџӡʜџ ʙҁё ӌϯѳ đєʌѧєϯ ϶ϯѳ ҁѳҁёϯ ʜѧʍ ӡѧ ҁʙѳё ʍєҁϯѳ πѳđ ҁѳʌʜҵєʍ.',
'𓌵👁️‍🗨️ ⴼє κƴⱀџ πѳҁʌє ҁʙѳєӣ ʍѧϯєⱀџ ѣƀӀӌκѧҁѳҁ ʍѧʌѳʌєϯʜџӣ ʙєđƀ ӡʜѧєɯƀ ӌϯѳ κƴⱀџϯƀ πѳҁʌє đѧʙѧʌѳκ ҁӌџϯѧєϯƀҁᴙ πʌѳχџʍ πѳⱀѳґѳʍ ʌƴӌɯє đѧӣ єӣ ʜѧ ⱀѳϯѧ џ џđџ κƴπџ ʜѳⱀʍѧʌƀʜƀӀχ ҁџґѧⱀєϯ џ ʜє đѧʙѧӣ ҁʙѳєӣ ʍѧϯєⱀџ єё ѫџⱀʜƀӀʍџ πѧʌƀҵѧʍџ đѧѫє πⱀџκѳҁʜƴϯƀҁᴙ κ πѧӌκџ.',
'𓌵👁️‍🗨️ ∏єⱀʙƀӀӣ џ πѳҁʌєđʜџӣ ⱀѧӡ ᴙ πѳʙєⱀџʌ ϯʙѳєӣ ʍѧϯєⱀџ ʙєđƀ ϶ϯѧ ѣʌᴙđѳʙκѧ ҁκѧӡѧʌѧ ӌϯѳ єё єѣѧʌџ ʜє ѣѳʌƀɯє ϯƀӀҁᴙӌџ ʌѥđєӣ ʜѳ ʜѧ đєʌє ѳκѧӡѧʌѳҁƀ ӌϯѳ єё đⱀѧʌџ πѳʌ ґѳⱀѳđѧ џ đѧѫє κѧѫđƀӀӣ πѳđϯʙєⱀđџʌ ʍƀӀ ʍѳѫєʍ ƴҁⱀѧџʙѧϯƀ ҁχѳđκƴ ёѣƀӀⱀєӣ ϯʙѳєӣ ʍѧʍƀӀ.',
'𓌵👁️‍🗨️ ∏ёϯⱀ 1 ϯѧκ ӡʙѧʌџ πєⱀʙѳґѳ ёѣƀӀⱀᴙ ϯʙѳєӣ ʍѧʍκџ ϯƀӀ đѳʌѫєʜ єґѳ ӡʜѧϯƀ ʙєđƀ ʙƀӀ πⱀѳχѳđџʌџ єґѳ ʙ ɯκѳʌє џ ϯƀӀ πѳʜџʍѧєɯƀ ʜѧҁϯѳᴙѱџѥ πⱀџӌџʜƴ єґѳ ҁʍєⱀϯџ ѳʜ ѣƀӀʌ χѳⱀѳɯџʍ џʍπєⱀѧϯѳⱀѳʍ ʜѳ κѳґđѧ ϯʙѳᴙ ʍѧϯƀ ҁϯⱀєʍџʌѧҁƀ ҁđєʌѧϯƀ єʍƴ ѳϯҁѳҁ κѧѫđƴѥ ҁєκƴʜđƴ πⱀѳҁϯџϯє ӡđєҁƀ ʌѥѣѳӣ ҁκѳʜӌѧєϯƀҁᴙ.',
'𓌵👁️‍🗨️ Ƴѫє πѳɯʌџ πєҁʜѥ πⱀѳ ϯʙѳѥ ʍѧϯƀ ʜє ϯѳ ӌϯѳ ӌѧҁϯƴɯκџ ʙ ϶ϯџχ πєҁʜᴙχ πѳёϯƀҁᴙ ѳ ⱀѧӡѳӌєⱀѳʙѧʜџє ʙєđƀ ʙҁє đƴʍѧʌџ ӌϯѳ ϯʙѳᴙ ʍѧϯƀ πⱀѳҁϯѳ єѣѧʜʜѧᴙ πѳđҁϯџʌκѧ ʜѳ πѳҁʌє ϯѳґѳ κѳґđѧ ѳʜџ ƴӡʜѧʌџ ӌϯѳ ѳʜѧ đѧʙѧʌѧ đѧѫє ѣєґєʍѳϯƴ ʜєϯ ʜƴ πⱀѳҁϯџϯє ϶ϯѳ ҁʌџɯκѳʍ.',
'𓌵👁️‍🗨️ ⴼє ʙєɯѧӣ ʜѳҁ ʍѳѫєϯ єѱё ʙҁё џӡʍєʜџϯƀҁᴙ ʙ ʌƴӌɯƴѥ ҁϯѳⱀѳʜƴ πѳџѱџ ʙ ҁʙѳєӣ ʍѧʍє χѳⱀѳɯџє ҁϯѳⱀѳʜƀӀ ʙєđƀ ѳʜџ đѳʌѫʜƀӀ ѣƀӀϯƀ ʙѳϯ πⱀџʙєđƴ πⱀџʍєⱀ ϯʙѳᴙ ʍѧϯƀ ҁѳҁєϯ κѧѫđѳʍƴ ϯєʍ ҁѧʍƀӀʍ đєʌѧᴙ đѳѣⱀѳ ʍѳѫєɯƀ ʜѧӡƀӀʙѧϯƀ єё ѣѳґџʜєӣ đѳѣⱀѧ.',
'𓌵👁️‍🗨️ Ѧ ϯƀӀ đƴʍѧʌ ӌϯѳ ᴙ ʜє πⱀџđƴ џ ʜє ʜѧҁҁƴ ϯʙѳєӣ ʍѧϯєⱀџ ʜѧ єѣʌєϯ ϯƀӀ ҁџʌƀʜѳ ѳɯџѣѧʌҁᴙ ʙєđƀ πѳҁʌє ҁʌѳʙ ӌϯѳ ᴙ ʜє đѳҁϯѳџʜ ϯѳґѳ ӌϯѳѣƀӀ πⱀџđƴɯџϯƀ єё χƴёʍ ᴙ ѳӌєʜƀ ⱀѧӡѳӡʌџҁᴙ πѳҁʌє ϯѳґѳ κѧκ ᴙ єё ѳϯπџʜѧʌ ʜѳґѧʍџ ѳʜѧ χѳđџϯ ϯєπєⱀƀ ϯѳʌƀκѳ ʜѧ πѳʙѳđκє.',
'𓌵👁️‍🗨️ Ҟѳґđѧ ϯʙѳᴙ ʍѧϯƀ κџʜƴʌѧ ӡџґƴ ᴙ ƴѫє πѳʜᴙʌ ӌϯѳ ϶ϯѳ ɯκƴⱀѧ ʜѧҵџҁϯҁκѧᴙ џ єё ʍѳѫʜѳ πєⱀđѳʌџϯƀ χѳϯƀ 24 ӌѧҁѧ ʙ ҁƴϯκџ ʜѳ ⱀєɯџʌ πⱀѳʙєⱀџϯƀ ϯѧκ ҁκѧӡѧϯƀ ʜѧ ѫџʙҵѧ κџʜƴʌ ⱀєӡџʜѳʙƀӀӣ ҁϯⱀѧπѳʜ џ πⱀєđҁϯѧʙʌᴙєɯƀ ѳʜѧ κџʜƴʌѧҁƀ ʜѧ ʜєґѳ κѧκ ҁѳѣѧκѧ єѣѧʜʜѧᴙ.',
'𓌵👁️‍🗨️ Λџɯƀ ѣƀӀ ҁʜѳʙѧ ҁєґѳđʜᴙ ʜє ʙҁϯⱀєϯџϯƀҁᴙ ҁ ϯʙѳєӣ ʍѧϯєⱀƀѥ ʙєđƀ ҁѧʍ πѳʜџʍѧєɯƀ ϯᴙѫєʌѳ ϯєⱀπєϯƀ ҁѳϯƀӀӣ ѳϯҁѳҁ ʙ đєʜƀ ʜѧ ҁѧʍѳʍ đєʌє ᴙ ƴѫє ʜѧӌџʜѧѥ єё ѣѳᴙϯƀҁᴙ ʍѧʌѳ ʌџ ѳʜѧ ʙƀӀҁκѳӌџϯ џӡ ӡѧ ƴґʌѧ џ ʜѧӌʜєϯ ʜѧᴙⱀџʙѧϯƀ ґƴѣѧʍџ ʍѳӣ χƴӣ ʜѧđѳ ѳҁϯєⱀєґѧϯƀҁᴙ.',
'𓌵👁️‍🗨️ ᛖƀӀ ӡđєҁƀ ʌџɯƀ đʌᴙ ϯѳґѳ ӌϯѳѣƀӀ đѳκѧӡѧϯƀ ӌϯѳ ⱀѳϯ ϯʙѳєӣ ʍѧʍƀӀ ʜє ϯѳʌƀκѳ đʌᴙ єđƀӀ ϶ϯѳ ʙϯѳⱀѳҁϯєπєʜʜѳ ѧ ʜѧᴙⱀџʙѧϯƀ ʜѧɯџ ӡѧʌƴπƀӀ ѳʜѧ đѳʌѫʜѧ џʜҁϯєʜκϯџʙʜʜѳ ӡʜѧєɯƀ κѧκ ⱀєѻʌєκҁ єё πѧʍᴙϯƀ ӡѧϯƴʍѧʜџʌѳ џ ʙҁё ӌϯѳ ѳʜѧ ӡʜѧєϯ κѳʍѧʜđƴ ҁѳҁѧϯƀ.',
'𓌵👁️‍🗨️ ∏ѳđʙєđёʍ џϯѳґџ ӡѧ ϶ϯѳϯ ʍєҁᴙҵ ӌϯѳ ҁđєʌѧʌѧ ϯʙѳᴙ ʍѧʍѧ đѧ єҁʌџ ϯѧκ ѣⱀѧϯƀ ʙⱀѳđє џ ʜџӌєґѳ ʙ ґʌѳѣѧʌƀʜѳʍ ʍѧҁɯϯѧѣє ʜѳ ʙҁє ϯѧκџ ѳʜѧ πѳπⱀѳѣƀӀʙѧʌѧ ʜѧ ʜѧɯєʍ ⱀѧӣѳʜє ҁѧʍƀӀє ⱀѧӡʜƀӀє ʙκƴҁƀӀ ӡѧʌƴπ џ ӡʜѧєɯƀ ϶ϯѳ ʜѧʙєⱀʜѳ ʜєπʌѳχѳ.',
'𓌵👁️‍🗨️ ∏ѳκѧ ϯƀӀ ϯѧʍ ҁϯƴӌџɯƀ πѳ κʌѧʙџɯѧʍ ᴙ ƴѫє ӡѧκџđƀӀʙѧѥ ʜѧ ⱀѳϯ ϯʙѳєӣ ʍѧʍɯџ ѳπⱀѧʙđƀӀʙѧӣҁᴙ ҁκѳʌƀκѳ χѳӌєɯƀ ʜѳ ϯєѣє ʜє џӡєѫѧϯƀ ѻѧκϯѧ ϯѳ ӌϯѳ ϯʙѳᴙ ʍѧϯƀ ɯѧʌѧʙѧ єѣʌџʙѧᴙ џ ҁѳӡđѧʜʜѧ ϯѳʌƀκѳ đʌᴙ ʜѧҁ џ đʌᴙ ʜѧɯєґѳ κⱀƴґѧ ѳѣѱєʜџᴙ.',
'𓌵👁️‍🗨️ Ϯєⱀπџʌѧ ϯƀӀ єѣѧʜʜѧᴙ ʍѳѫєɯƀ đѧʌƀɯє ґѳʙѳⱀџϯƀ ӌϯѳ ϯʙѳѥ ʍѧϯƀ ʜє κϯѳ ʜє єѣѧʌ ᴙ ʍѳґƴ πⱀᴙʍ ҁєӣӌѧҁ πⱀџϯѧѱџϯƀ єё ӡѧ ɯκџⱀᴙϯʜџκ џ ѳʜѧ ѣƴđєϯ ƴʍѧʌᴙϯƀ ʜѧ κѳʌєʜᴙχ ӌϯѳѣƀӀ ᴙ ʜєʍʜѳѫκѳ πѳʍѧҁџⱀѳʙѧʌ єё ⱀѳϯ ӡѧʌƴπѳӣ ʍƴđѧκ ϯƀӀ єѣѧʜʜƀӀӣ.',
'𓌵👁️‍🗨️ Ɓ κѧѫđѳʍ ʍџⱀє єҁϯƀ ϯѧκѧᴙ ϶єʜѱџʜѧ κѳϯѳⱀѧᴙ ӡѧ ґⱀѳɯџ ґѳϯѳʙѧ ʙӡᴙϯƀ ʙ ⱀѳϯ ʜѳ ʜє ϯʙѳᴙ ʍѧʍѧ єӣ ʙѳѣѱє ʜє ʜƴѫʜƀӀ đєʜƀґџ ϯѳʌƀκѳ ʌџɯƀ ѳѣєѱѧʜџᴙ ӌϯѳ ʙ ѣƴđƴѱєʍ ϯƀӀ ʍѳѫєϯ ѣƀӀϯƀ πѳєѣёɯƀ єё єѱё ѳʜѧ ʙҁєґđѧ ʙєⱀџϯ ʜѳ ʜє κϯѳ πѳʙϯѳⱀʜѳ єё ʜє ʙƀӀπѳⱀѳʌ.',
'𓌵👁️‍🗨️ ∏ѳ ϯʙѳєʍƴ ʙџđƴ ʙџđʜѳ ӌϯѳ ϯƀӀ ӡѧѫѧϯƀӀӣ ѣєđѳʌѧґѧ κѳϯѳⱀƀӀӣ đѧѫє ʜє ʍѳѫєϯ πѳҁϯѳᴙϯƀ ӡѧ ҁʙѳѥ ʍѧʍѧʜѥ ѧ ӌϯѳ єҁʌџ ᴙ ҁєӣӌѧҁ ʙѳӡƀʍƴ χƴӣ џ πⱀѳπџχʜƴ єӣ ʙ ґʌѳϯκƴ ӌϯѳ ϯƀӀ ѣƴđєɯƀ đєʌѧϯƀ đѧ ʙҁє ӡʜѧѥϯ ӌϯѳ ϯƀӀ πѳӡѳʙʜџɯƀ πѧπє ʜѳ ѳʜ ѳπᴙϯƀ πⱀџєđєϯ џ ӡѧʍєʜџϯ єё.',
'𓌵👁️‍🗨️ đѧ ᴙ ϯʙѳѥ ʍѧϯƀ κƴⱀѧπѧκƴ ʙʜѧϯƴⱀє єѣѧʌ πѳʌӡџ ʜѧχƴӣ ѳϯ ҁѥđѧ đⱀƀӀѱ єѣѧʜʜƀӀӣ',
'𓌵👁️‍🗨️ ᴙ ϯʙѳєӣ ʍѧϯєⱀџ χƴёʍ ѱѧҁ πѳ ⱀƀӀʌƴ ҁъєӡѫƴ ҁʌѧѣѧκ єѣʌџʙƀӀӣ đѧʙѧӣ ҁѳҁџ ʍʜє ϯƴϯ џ ϯѳʌƀκѳ πѳπⱀѳѣƴӣ ѳϯκџʜƴϯƀҁᴙ џӡ ϶ϯѳӣ κѳʜѻєⱀєʜҵџџ',
'𓌵👁️‍🗨️ đѧ ᴙ ѱѧҁ ϯʙѳѥ ʍѧϯƀ ϯƴϯ ӌπѳκʜƴ ϯƀӀ πѳʜџʍѧєɯƀ ϶ϯѳ πѳɯёʌ ʜѧχƴӣ ѳϯ ҁѥđѧ πѳκѧ ᴙ ϯєѣє πѧϯʌџ ϯƴϯ ʜє πєⱀєʌѳʍѧʌ',
'𓌵👁️‍🗨️ ᴙ ϯєѣє ʙʜѧϯƴⱀє ʜѧ κʌƀӀκ ѱѧҁ κџʜƴ ҁʌѧѣѧκ đѧʙѧӣ πⱀџđџ ʙ ҁєѣᴙ џ đѧӣ ѳϯπѳⱀ ʍʜє ϯƴϯ',
'𓌵👁️‍🗨️ κƴⱀџҵѧ єѣѧʜʜѧᴙ ϯƀӀ ⱀєɯџʌ џӡ ϶ϯѳӣ κѻ κѧκ ʙƀӀѣⱀѧϯƀҁᴙ єҁʌџ ᴙ ҁ ѣⱀѧϯκѧʍџ ʙʜѧϯƴⱀє ѳϯ ϯєѣᴙ ϯƴϯ ʜє χƴᴙ ʜє ѳҁϯѧʙʌѥ',
'𓌵👁️‍🗨️ ѣƴđƀ κѧκ ᴙ ʙѳϯ πⱀџɯёʌ đѧʌ ϯʙѳєӣ ʍѧϯєⱀџ ʜѧ ⱀѳϯѧʜ ӌё єѱё ʙ ѫџӡʜџ ʜѧđѳ џʌџ ϯƀӀ ⱀєɯџʌ ƴ ʍєʜᴙ ʜѧ ⱀѳϯѧʜ ʙӡᴙϯƀ ɯƴϯʜџκ єѣѧʜʜƀӀӣ',
'𓌵👁️‍🗨️ ʜє ѣƴđєʍ πєⱀєχѳđџϯƀ ʜѧ ʌџӌʜѳҁϯџ ᴙ πⱀѳҁϯѳ ϯʙѳѥ ʍѧϯƀ єѣѧʌ ʙʜѧϯƴⱀє',
'𓌵👁️‍🗨️ ᴙ κѳґđѧ ϯʙѳѥ ʍѧϯƀ ʙҁϯⱀєϯџʌ πєⱀєπƴϯѧʌ єё ҁ ҁѳѣѧκѳӣ єѣѧʜʜѳӣ ϯƀӀ πⱀџκџʜƀ',
'𓌵👁️‍🗨️ ᴙ πѳӌєʍƴ ϯѳ ʜє ⱀєɯѧʌҁᴙ πѳđѳӣđϯџ κ ϯʙѳєӣ ʍѧϯєⱀџ κѧκ ϯѳ ӡѧѳѳѣѱѧϯƀҁᴙ ʜѳ ʙ џϯѳґє πѧҵѧʜƀӀ ҁκѧӡѧʌџ ӌϯѳ ѳʜѧ ɯѧʌѧʙѧ єѣѧʜʜѧᴙ џ ᴙ ѣєӡ ʙҁᴙκџχ ʜєϯ ʙƀӀєѣѧʌ єё',
'𓌵👁️‍🗨️ ʜє πⱀєđҁϯѧʙʌᴙѥ κѧκ ᴙ ѣƴđƴ єҁʌџ ϯʙѳᴙ ʍѧϯƀ ƴʍⱀєϯ ϶ϯѳ πѳʌƴӌѧєϯƀҁᴙ ᴙ ʜє ҁʍѳґƴ πѳӡʙѳʜџϯƀ џ ҁκѧӡѧϯƀ đѧʙѧʌκѧ єѣѧʜʜѧᴙ đѧʙѧӣ πⱀџѣєґѧӣ ʍƀӀ ϯєѣᴙ ʙƀӀєѣѧϯƀ χѳϯџʍ',
'𓌵👁️‍🗨️ ϯƀӀ ӌё ҵѧπʌᴙ єѣѧʜʜѧᴙ ᴙ ʙ ϶ϯѳӣ κѻ ѳϯ ϯєѣᴙ ϯƴϯ ʜє χƴᴙ ʜє ѳҁϯѧʙʌѥ ҁѳѣѧκѧ ϯⱀѧʙʍџⱀѳʙѧʜʜѧᴙ ϯƀӀ πƴϯџ ѳϯχѳđѧ đѧʙѧӣ џѱџ',
'𓌵👁️‍🗨️ ʜє πⱀѳҁϯѳ ᴙ ϯʙѳѥ ʍѧϯƀ єѣѧʌ ʍʜє ґѳʙѳⱀџʌџ єѣѧϯƀ ѳʜѧ đѫџʜ ʙ џϯѳґє ᴙ єё ӡѧ đѫџʜϯѳʜџκ ʙƀӀєѣѧʌ',
'𓌵👁️‍🗨️ ϯƀӀ đѧʙѧӣ єѣѧϯƀ ʜє ѳπⱀѧʙđƀӀʙѧӣҁᴙ ѳϯκⱀƀӀʙѧӣ ⱀѳϯ ᴙ ѱѧҁ ϯєѣє πѧđʌѧ ґʌѧʜđƀӀ ϯƴϯ ӡѧʌƀѥ',
'𓌵👁️‍🗨️ đѧʙѧӣ ᴙ ϯʙѳѥ ӡѧđʜџҵƴ ɯѧκѧʌѧ єѣѧʜʜƀӀӣ ѱѧҁ ϯƴϯ ⱀѧӡđџⱀѧϯƀ ѣƴđƴ ϯƀӀ ʙʜѧϯƴⱀє ⱀєɯџʌ ʍєʜᴙ ѳҁџʌџϯƀ',
'𓌵👁️‍🗨️ ϯʙѳӣ ґѳʌџʍƀӀӣ đđ ϯƴϯ џ ʍєҁᴙҵѧ ʜє πⱀѳҁϯѳџϯ ϯƀӀ ʙѳѳѣѱє ɯѧⱀџɯƀ ҁ κєʍ ҁʙᴙӡѧʌҁᴙ ʍѧʌƀӀɯƀ',
'𓌵👁️‍🗨️ ϯƀӀ ѳπᴙϯƀ ѣⱀƴӌєʜʜƀӀӣ đđ ʙӡᴙʌ ϯѳʌƀκѳ πѳϯѳʍ ʜє πʌѧӌƀ ʍʜє ʙ ʌҁ ӌϯѳ πⱀѳҁϯѳ ɯѧѣʌƀӀ πєⱀєҁϯѧʙʌᴙʌ',
'𓌵👁️‍🗨️ ʜƴ ѫє ᴙ ѱѧҁ ѳϯ ϯʙѳєӣ ґѳʌѳʙƀӀ ʜє χƴᴙ ʜє ѳҁϯѧʙʌѥ ѳπᴙϯƀ ѣƴđєɯƀ ƴ ʍєʜᴙ πⱀѳҁџϯƀ ӡѧ ϯєѣᴙ đđ πѳҁϯѧʙџϯƀ',
'𓌵👁️‍🗨️ đѧ ҁƀӀʜ ɯʌѥχџ єѣѧʜʜƀӀӣ ϯƀӀ đѧѫє єҁʌџ ʙєҁƀ κѳɯєʌёκ ʍѧʍκџʜ ʙƀӀʙєⱀʜџɯƀ ƴ ϯєѣᴙ ʜє χʙѧϯџϯ πѳӡʙѳʌџϯƀ ҁєѣє ʍѳӣ đđ',
'𓌵👁️‍🗨️ đѧ ᴙ ϶κҁϯѧӡ єѣѧʌ ɯѧⱀџɯƀ ӌϯѳ ϯƀӀ ϯƴϯ ʍʜє ʍѳѫєɯƀ ҁκѧӡѧϯƀ ʙєđƀ ᴙ џ ϯʙѳё ⱀƀӀʌѳ ʜѧ 3 ҁϯѳⱀѳʜƀӀ ʙƀӀʙєⱀʜƴ',
'𓌵👁️‍🗨️ ʜƴ ѫє ѳπⱀѧʙđѧӣ ҁєѣє ϯєʍ ӌϯѳ ϯʙѳӣ đđ ѳχƴєʜʜƀӀӣ ʜѳ πⱀѳҁϯѳ ѣѳϯ ґѳʙʜѳ đѧ ᴙ ϯʙѳѥ ʍѧϯƀ єѣѧʌ',
'𓌵👁️‍🗨️ ʜє ѣƴđƀ ѻѧⱀɯʍѧκѳʍ ʙѳӡƀʍџ ҁєѣᴙ ʙ ⱀƴκџ џ πʌѥʜƀ ʙ єѣѧʌѳ ϶κҁϯѧӡƴ ƴҁϯⱀџҵѧ єѣѧʜʜѧᴙ',
'𓌵👁️‍🗨️ ʜє ʙʜѧϯƴⱀє ᴙ ѱѧҁ ⱀѧӡʍѧχʜƴҁƀ џ ʙъєѣƴ ѳπʌєʙƴχƴ ϯʙѳєӣ ʍѧϯєⱀџ χƴʌџ ѳʜѧ ʍѳё ӌҁʙ ϯƴϯ ҁѣџʙѧєϯ',
'𓌵👁️‍🗨️ ᴙ ϯєѣᴙ ѳѣџđєʌ ϯєʍ ӌϯѳ ᴙ ʙƀӀєѣѧʌ ϯʙѳѥ ʍѧϯƀ ϯѳґđѧ πѳʌƴӌѧєϯƀҁᴙ ϯєѣᴙ ѳѣџđєʌ ʙєҁƀ ⱀѧӣѳʜ ӌϯѳ ʌџ ҵѧπʌᴙ єѣƴӌѧᴙ',
'𓌵👁️‍🗨️ ʜƴ ѫє đѧʙѧӣ ҁκѧѫџ ʍʜє ӌϯѳ ʜџѣƴđƀ πѳκѧ ᴙ χѧⱀκѧѥ ʙ єѣѧʌѳ ϯʙѳєӣ ʍѧϯєⱀџ џʌџ ѳπᴙϯƀ ʜѧӌʜёɯƀ ґѳʙѳⱀџϯƀ πⱀѳ ϯѳπѳπʙƀӀє đєđџκџ',
'𓌵👁️‍🗨️ đѧ ϯƀӀ ӡʜѧєɯƀ κϯѳ ӡѧ ʍєʜᴙ ҁϯѳџϯ đѧ ʍѳӣ đđ ґѳđ ҁϯѳџϯ ҁʌƀӀɯџɯƀ ҁʌѧѣѧκ ϯѧκ ϯƀӀ ѫє ʍʜє ʙҁє ⱀѧʙʜѳ ʙ ϶ϯѳӣ κѻ ѳϯκџʜєɯƀҁᴙ ӡѧ ʜєđєʌѥ',
'𓌵👁️‍🗨️ ʜƴ ѫє πѳъᴙҁʜџ ʍʜє χѳϯᴙ ѣƀӀ ӡѧ ϯѳ ӌϯѳ ϯʙѳᴙ ʍѧϯƀ ƴ κѧѫđѳґѳ πⱀѳχѳѫєґѳ ʙ ⱀѳϯ ѣєⱀєϯ џʌџ ѳπᴙϯƀ ҁκѧѫєɯƀ ϶ϯѳ ʙҁё πѳϯѳʍƴ ӌϯѳ ʍʜє ʜƴѫєʜ ϯѳπѳʙƀӀӣ đđ',
'𓌵👁️‍🗨️ ϯƀӀ đѧʙѧӣ ʍʜє ϯƴϯ ʜє ѳϯκџʜƀҁᴙ χѳϯᴙ ѣƀӀ ӡѧ 3 ʍєҁᴙҵѧ ѧ ϯѳ ᴙ ʙʜѧϯƴⱀє ӡѧđџѣѳɯџⱀѥ џ ϯʙѳѥ ʍѧϯƀ ʙ πƴχ џ πⱀѧχ ҁѳϯⱀƴ πⱀᴙʍ κѧκ ʍѧϯƀ ϶κҁϯѧӡџ',
'𓌵👁️‍🗨️ ʜє ϯƀӀ ʙʜѧϯƴⱀє πѧⱀѧʙѳӡ єѣѧʜʜƀӀӣ ϯƀӀ ʜѧχƴӣ ƴ ʍѧϯєⱀџ ѣƀӀӌκџ πџӡđџɯƀ ᴙ ѫє єӣ ҁ πѧҵѧʜѧʍџ ʜѧ ⱀѳϯѧ đѧʙѧʌ ѧ ϯƀӀ πѳҁʌє ʜєё κƴⱀџɯƀ ʙѧѻёʌ єѣѧʜʜƀӀӣ',
'𓌵👁️‍🗨️ đѧʙѧӣ ϯƀӀ ʍʜє ѱѧҁ ϯƴϯ χƴӣ ѳϯҁѳҁєɯƀ ѧ ᴙ ϯєѣᴙ ʜє ѣƴđƴ πџđѧⱀѧҁџϯƀ πѳ ʙҁєʍƴ ⱀƴʜєϯƴ ʙʜѧϯƴⱀє ѫє ʙƀӀґѳđʜѳ đʌᴙ ϯєѣᴙ ѻѧⱀɯʍѧκѧ',
'𓌵👁️‍🗨️ ʜє ӡѧѣƴđƀ κѧκ πⱀџđєɯƀ đѳʍѳӣ ҁκѧӡѧϯƀ ҁʙѳєӣ ʍѧϯєⱀџ ӌϯѳ ᴙ єё ӌєχʌџϯƀ ѣƴđƴ џʌџ ϯƀӀ ⱀєџɯʌ ѣʌᴙϯƀ ӌϯѳ ᴙ ƴѫє ʜє єѣƴ ϯʙѳѥ ʍѧϯƀ',
'𓌵👁️‍🗨️ đѧʙѧӣ ѱѧҁ πѳѣѧӡѧⱀџʍ ʜѧ ҁӌєϯ ϯєʍƀӀ ӌϯѳ ϯʙѳᴙ ʍѧϯƀ ɯʌѥχѧ ᴙ πѳʜџʍѧѥ ϯєѣє ʜє πⱀџᴙϯʜѳ ʜѳ єӣ ѫє πⱀџᴙϯʜѳ ӌϯѳ ʍƀӀ єё єѣёʍ',
'𓌵👁️‍🗨️ đѧʙѧӣ ѱѧҁ ϯƀӀ ӡѧϯκʜёɯƀ ҁʙѳё єѣѧʌѳ џ πⱀѳҁϯѳ πⱀџӡʜѧєɯƀ ӌϯѳ ϯʙѳᴙ ʍѧϯƀ ɯʌѥχѧ єѣѧʜʜѧᴙ џ ӌϯѳ ϯѧκѳӣ ʙƀӀⱀѳđѳκ κѧκ ϯƀӀ єӣ ʜѧχƴӣ ʜє ҁđѧʌҁᴙ',
'𓌵👁️‍🗨️ ʜє ѧ ϯƀӀ ӌё ѱѧҁ πⱀѳҁϯѳ ϯѧκ ʙѳӡƀʍёɯƀ ʍѳӣ χƴӣ џ ѳϯҁѳҁёɯƀ ʜƴ ϯƀӀ đѧʙѧӣ ѳѣđƴʍѧӣ ҁєⱀƀєӡʜѳ ϯѳ ӌϯѳ ᴙ πѳҁʌє ϶ϯѳґѳ ʙҁє ⱀѧʙʜѳ ʙƀӀєѣƴ ϯʙѳѥ ʍѧϯƀ',
'𓌵👁️‍🗨️ ʜє ʜƴ ϯƀӀ  ϯєѣᴙ ʙʜѧϯƴⱀє ѱѧҁ ɯѧʍѧⱀʜƴ ϯƀӀ πѳӣđёɯƀ ʙ ʍƴҁѧⱀʜѥ ӡѧᴙʙƴ πџҁѧϯƀ πѳκѧ ᴙ ϯʙѳѥ ʍѧϯƀ єѣƴ ƴϯκѧ єѣѧʜʜѧᴙ ',
'𓌵👁️‍🗨️ ᴙ κѳґđѧ ϯʙѳѥ ʍѧϯƀ πѳđ πⱀџχѳđѳʍ ґєⱀƀӀӌѧ єѣѧʌ ѳʜѧ κѧӡѧʌѧҁƀ κⱀѧҁџʙѳӣ ʙ џϯѳґє κѳґđѧ ʍєʜᴙ ѳϯπƴҁϯџʌѳ ᴙ ѣєѫѧʌ ʙ ҁϯⱀѧχє ѳϯ ϯʙѳєӣ ʍѧϯєⱀџ',
'𓌵👁️‍🗨️ ᴙ ѳѣƀӀӌʜѳ πƀѥ ӡѧ đʙє ʙєѱџ ʜѧ ӡѧ ҁϯѳʌƀє ӌϯѳѣƀӀ χƴӣ ҁϯѳᴙʌ џ ϯʙѳᴙ ʍѧϯƀ πѳѣʌџѫє ѣƀӀʌѧ',
'𓌵👁️‍🗨️ ʜƴ đѧʙѧӣ ᴙ ϯʙѳё ⱀƀӀʌѳ ʙ ϶ϯѳӣ κѻ ѳѣκѳʜӌѧѥ κѧκ ϯƀӀ πѳϯѳʍ ѣƴđєɯƀ ⱀѧҁκѧӡƀӀʙѧϯƀ ҁʙѳџʍ đⱀƴӡƀᴙʍ ӌϯѳ ϯƀӀ ʍєʜᴙ ʙƀӀʙєӡ',
'𓌵👁️‍🗨️ ϯʙѳᴙ ʍѧϯƀ ѳϯ ʜєđѳϯⱀѧχѧ ʜѧ κѧѫđƀӀӣ κѳʌ ʌєӡєϯ ᴙ ƴѫє ʜє ӡʜѧѥ ӌё đєʌѧϯƀ ʍѳѫєϯ ѳɯєӣʜџκ κƴπџϯƀ κѧκ đƴʍѧєɯƀ',
'𓌵👁️‍🗨️ ᴙ κѧκ џʍπєⱀѧϯѳⱀ ϯʙѳᴙ ʍѧϯƀ ƴ ʍєʜᴙ ʙ ʜѳґѧχ πѳʌӡѧєϯ ʜѳ πⱀџ ϶ϯѳʍ ᴙ ѫџʙƴ κѧκ ʙҁє ʜѳ πѳӌєʍƴ ϯʙѳᴙ ґѳⱀᴙ ʍѧϯƀ ʍʜє ϯѳ ҁѳҁёϯ',
'𓌵👁️‍🗨️ єҁϯƀ πⱀџʌѳѫєʜџᴙ єҁʌџ κƴπџɯƀ 3 πѧӌκџ ҁƴχѧⱀџκѳʙ ҁκѧʜџⱀƴєɯƀ ӌєκ џ ϯєѣє ѣєҁʌπѧϯʜѳ ʙƀӀπѧđѧєϯ ёѣ ϯʙѳєӣ ʍѧϯєⱀџ ѳϯ ѳđʜѳґѳ đѳ đєҁᴙϯџ ⱀѧӡ',
'𓌵👁️‍🗨️ ʜƴ ѫє đѧʙѧӣ ѳκʌєʍѧӣҁᴙ ѳϯ πѳѣѳєʙ ʍѳєґѳ ӌєʌєʜѧ џ ҁʍєⱀџҁƀ ҁ ʍƀӀҁʌƀѥ ӌϯѳ єѣƴ ϯʙѳѥ ʍѧϯƀ ʜє ϯѳʌƀκѳ ᴙ ʜєχƴӣ ʜѧ ʍєʜᴙ ѣƀӀӌџϯƀ',
'𓌵👁️‍🗨️ ϯʙѳᴙ ʍѧϯƀ κѳґđѧ ӌϯѳ ʜџѣƴđƀ ґѳϯѳʙџϯ ʜє ѳѣχѳđџϯƀҁᴙ ѣєӡ ʍџʜƀєϯѧ ʙєđƀ ϶ϯѧ ɯκƴⱀѧ ʌѥѣџϯ ѳϯҁѧҁƀӀʙѧϯƀ ʙѳ ʙⱀєʍᴙ ґѳϯѳʙκџ ѳχƴєɯƀ ʍѧʌƀӀӣ',
'𓌵👁️‍🗨️ ᴙ ѣʌᴙ ʜє ӡʜѧѥ ʍѳѫєϯ џ ᴙ ϯʙѳӣ ѳϯєҵ ϯƀӀ ϶ϯѳ ʜє ⱀѧҁϯⱀѧєʙѧӣҁᴙ χƴӣ ӡʜѧєϯ ϯʙѳѥ ʍѧϯƀ đѳχƴᴙ κϯѳ єѣѧʌ',
'𓌵👁️‍🗨️ đѧʙѧӣ πѳџґⱀѧєʍ ʙ κѧⱀϯƀӀ ʜѧ ϯʙѳѥ ʍѧϯƀ đѧѫє єҁʌџ ᴙ πⱀѳџґⱀѧѥ ϯƀӀ ѫє πѳʜџʍѧєɯƀ ӌϯѳ ѳʜѧ ʙҁє ⱀѧʙʜѳ ʍѳᴙ',
'𓌵👁️‍🗨️ đѧ ґѳʙѳⱀѥ ϯєѣє ʜє đѧʍ ᴙ ϯєѣє đđ ӡѧ ϯʙѳѥ ʍѧϯƀ єё κϯѳ ϯѳʌƀκѳ ʜє єѣѧʌ ʜѧɯёʌ ⱀєʌџκʙџѥ ѣʌᴙϯƀ',
'𓌵👁️‍🗨️ đѧʙѧӣ ᴙ ϯʙѳѥ ʍѧϯƀ ϯƴϯ ӡѧϯⱀѧχѧѥ đѳ ҁʍєⱀϯџ џʌџ ϯƀӀ ӌё ϯѥѻᴙκ đѧѫє ҁѳπⱀѳϯџʙʌᴙϯҁƀᴙ ʜє ѣƴđєɯƀ ʜƴ ӡѧ ϶ϯѳ πⱀџđёϯҁƀᴙ ϯєѣᴙ πⱀѳґџѣѳʍ ɯʙƀӀⱀʜƴϯƀ',
'𓌵👁️‍🗨️ ᴙ ϯєѣє ҁєӣӌѧҁ ʙʜѧϯƴⱀє ᴙӣҵѧ ʙ ⱀѳϯ ӡѧҁƴʜƴ џ ϯƀӀ џχ ѣƴđƀ πѳʌѳҁκѧϯƀ đѳ κѳʜҵѧ ҁʙѳџχ đʜєӣ ƴёѳκ πѳɯёʌ ʜѧχƴӣ ѳϯ ҁѥđѧ πѳʜᴙʌ',
'𓌵👁️‍🗨️ ʙѳϯ єҁʌџ ѣƀӀ ϯƀӀ πⱀѳᴙʙџʌ χѳϯᴙ ѣƀӀ κѧπʌѥ ƴʙѧѫєʜџᴙ ᴙ ѣƀӀ ʜє єѣѧʌ ϯʙѳѥ ʍѧϯƀ ѧ ϯѧκ ʜѧ ҁκѳⱀƴѥ ⱀƴκƴ ҁєӣӌѧҁ ϯʙѳєӣ ʍѧϯєⱀџ đƴπʌѳ πѳⱀʙƴ',
'𓌵👁️‍🗨️ ᴙ ϯєѣє χƴєʍ ҁєӣӌѧҁ πⱀѳҁϯⱀєʌѥ ӌʍѳɯʜџκ ᴙ ϯє ʙʜѧϯƴⱀє ҁєӣӌѧҁ κѧⱀϯєӌƀ ʙ ϯʙѳӣ ѫџʙѳϯ ʜѧχƴᴙӌƴ ϯƀӀ đƀӀⱀκѧ єѣѧʜѧᴙ ƴπѳʌӡѧӣ ҁ κѻ πѳκѧ ʙѳӡʍѳѫʜѳҁϯƀ єҁϯƀ',
'𓌵👁️‍🗨️ ᴙ ϯʙѳѥ ʍϯѧƀ ʜѧ πѳπƴϯκѧχ єѣѧʌ ѳʜѧ πƀӀϯѧʌѧҁƀ ʙ ʍѧɯџʜƴ πⱀƀӀґʜƴϯƀ ʜƴ ᴙ χєʌƴ κѧκ ӌʌєʜ єӣ ʙ ⱀѳϯ ӡѧҁƴʜƴʌ ϯѧκ ҁκѧӡѧϯƀ πⱀѳκѧϯџʌ ѣʌᴙϯƀ',
'𓌵👁️‍🗨️ єҁʌџ ϯʙѳᴙ ʍѧϯƀ ʙ ϯєӌєʜџє 5 ҁєκƴʜđ ʜє ѳπⱀѧʙđѧєϯ ҁєѣᴙ ʜѧ ҁӌёϯ ϯѳӣ ϯєʍƀӀ ӌϯѳ ѳʜѧ ʜѧ ⱀѧӣѳʜє ɯѧʌѧʙѧ ᴙ єё ʙƀӀєѣƴ ʌѳʌ ϶ϯѳ ⱀѳѻʌ ᴙ єё џ ϯѧκ ʙƀӀєѣƴ',
'𓌵👁️‍🗨️ ϯƀӀ єѣѧʜʜƀӀӣ ӡѧɯκʙѧⱀʜƀӀӣ ƴϯёʜѳκ ᴙ ҁєӣӌѧҁ πⱀѳҁϯѳ ʙѳӡƀʍƴ џ ҁ ⱀѧӡґѳʜѧ ʙƀӀɯџѣƴ ʍѳӡґџ ϯʙѳєӣ ʍѧϯєⱀџ πѳҁʌє ϶ϯѳґѳ ʜє ѻѧκϯ ӌϯѳ ѳʜѧ ѳκʌџʍѧєϯƀҁᴙ',
'𓌵👁️‍🗨️ ʍƀӀ κѳґđѧ ҁ đⱀƴӡƀᴙʍџ єӡđџʌџ ʜѧ ѳχѳϯƴ ѳѣєӡѧϯєʌƀʜѳ ѣⱀѧʌџ ϯʙѳѥ ʍѧϯƀ ϯƀӀ πѳƴđʍѧєɯƀ ѳʜѧ єѣƴӌџ ѳχѳϯџϯƀҁᴙ ʜє πⱀѳҁϯѳ ɯѧʌѧʙѧ ʜѧ ѳχѳϯє ʜє πѳʍєɯѧєϯ',
'𓌵👁️‍🗨️ ʙ ⱀƴκѧχ ѧʙϯѳʍѧϯ πѳϯѳʍƴ ӌϯѳ ҁѳʌđѧϯ єѣѧʌ ϯʙѳѥ ʍѧϯƀ  џ єѣƴ πѳϯѳʍƴ ӌϯѳ ʙƀӀӣґⱀѧʌ ʙѳӣʜƴ ᴙӣҵѧ ґʌѳϯѧӣ ӡѧ ѳϯӌџӡʜƴ ҁϯⱀєʌᴙӣ',
'𓌵👁️‍🗨️ ϯʙѳᴙ ʍѧϯƀ κѧκ πѳϯєⱀєʜʜƀӀӣ ʍѧʍѳʜϯёʜѳκ ʙѳѣѱє ʜє ѳⱀєʜϯџⱀƴєϯƀҁᴙ ʙ πⱀѳҁϯⱀѧҁʜϯʙє ᴙ єӣ ґѳʙѳⱀѥ ӌϯѳ ᴙ єё ʙƀӀєѣƴ ѳʜѧ ʜє ɯѧⱀџϯ џ πƀӀϯѧєϯƀҁᴙ ƴєχѧϯƀ κ ʍѧʍє',
'𓌵👁️‍🗨️ ᴙ ϯʙѳєӣ ʍѧʍƀӀ ʍѧʍƴ єѣѧʌ ϯƀӀ πѳʜџʍѧєɯƀ ӌϯѳ ʜѧɯџ ƴӡƀӀ ϯᴙҁʜѳ ҁʙᴙӡѧʜʜƀӀ ʍєѫđƴ ҁѳѣѳӣ ʙѧѻєʌ єѣѧʜʜƀӀӣ',
'𓌵👁️‍🗨️ ӡѧ đⱀƴӡєӣ џ đʙѳⱀ ҁϯⱀєʌᴙѥ ʙ ƴπѳⱀ ϯѧκ ґѳʙѳⱀџʌѧ ϯʙѳᴙ ʍѧϯƀ πѳκѧ ᴙ єӣ χƴєʍ ʜѧ ʌѣƴ ʜє ʙƀӀѫџґ κʌєӣʍѳ єѣѧʜʜѳӣ ɯʌѥχџ',
'𓌵👁️‍🗨️ ᴙ ϯʙѳєӣ ʍѧϯєⱀџ ʜѧ ѳѣєđ χƴӣ ʙ ⱀƀӀʌѳ ӡѧʙѳⱀѧӌџʙѧѥ џӡʙџʜџ ӡѧ ϯѧκѳӣ ʙѳπⱀѳҁ ϯƀӀ ʙƀӀѣʌᴙđѳκ ʜѳⱀʍѧʌƀʜѳ κ ϶ϯѳʍƴ ѳϯʜѳҁџɯƀҁᴙ єҁʌџ ʜєϯ ϯѳ ʍѳґƴ ӡѧʙѳⱀѧӌџʙѧϯƀ ʜѧ ƴѫџʜ',
'𓌵👁️‍🗨️ πѳ ϯѧκѳӣ ҁχєʍє ᴙ ʍѳґƴ ϯʙѳѥ ʍѧϯƀ єѣѧϯƀ ⱀѧӡ 40 ʜѳ ʍѳᴙ ҁχєʍѧ єѱё ʜє ҁѳʙєⱀɯєʜʜѧ ϯѧκ ӌϯѳ ϯʙѳѥ ʍѧϯƀ ɯѧʌѧʙƴ πѳκѧ ʜѧ ⱀѧҁʌѳѣѳʜє єѣƴ',
'𓌵👁️‍🗨️ ѣʌᴙ єѣѧϯƀ ϯƀӀ ӌё ӡѧ ʍƴđѧκ ϯƀӀ ϯѧʍ ӌё πџӡđєʌ ϯʙѳᴙ ʍѧϯƀ ʜє ɯʌѥχѧ ᴙ ϯʙѳѥ ⱀƀӀʌѳ ӌƴⱀκѧɯ πѳ ѻѧκϯƴ ʙ ϶ϯӣѳ κѻ ѳπƴɯƴ ӡѧ ϯѧκџє ҁʌѳʙѧ',
'𓌵👁️‍🗨️ đѧ đѧʙѧӣ ʜє πѳⱀѧʙđƀӀʙѧӣҁᴙ ᴙ ϯʙѳѥ ʍѧϯƀ єѣѧʌ ϯƀӀ ӌё ҵѧπʌᴙ ᴙ ѱѧҁ ϯʙѳѥ ʍѧϯƀ ϯƴϯ ϯѧκ ѳϯѫѧⱀѥ ӌϯѳ ϯƀӀ ѣѳʌƀɯє џӡ ϶ϯѳӣ κѻ ѣєӡ ґѳⱀʌѳʙѳґѳ ʍџʜƀєϯѧ ҁđєʌѧʜʜѳґѳ ʍʜє ʜє ʙƀӀӣđєɯƀ',
'𓌵👁️‍🗨️ πѳ πⱀџʜҵџπƴ ϯʙѳᴙ ʍѧϯƀ ϯѧκ ϯѳ ʜѳⱀʍѧʌƀʜѧᴙ ҁѳҁκѧ ʜє ʜƴ єʌџ ϯѧκ ⱀѧҁƴѫđѧϯƀ ᴙ ѣƀӀ ʍѳґ πѳƴχѧѫџʙѧϯƀ ӡѧ ʜєӣ ʜѳ ѫџӡʜƀ єҁϯƀ ѫџӡʜƀ єѣёʍ єё џ ӡѧєѣџҁƀ',
'𓌵👁️‍🗨️ đѧʙѧӣ ƴπѳⱀ ʌёѫѧ πⱀџʜᴙʌ џ ӡѧʌƴπƴ ʍʜє ʜѧӌџʜѧӣ ѳѣҁѧҁƀӀʙѧϯƀ ϯєѣє ҁѧʌѧґѧ ӌϯѳѣƀӀ ѳϯ ҁѥđѧ ƴӣϯџ ʍʜє ӡѧʌƴπƴ єѱё ґѳđ ѳѣҁѧҁƀӀʙѧϯƀ πⱀџđёϯƀҁᴙ',
'𓌵👁️‍🗨️ ᴙ κѧκ ϯѳ ʙѧʍ κⱀƀӀɯƴ đєʌѧʌ πѳʍʜџɯƀ ϯƀӀ ʍѧʌєʜƀκџӣ ѣƀӀʌ ʜѳ ʜѧ ҁѧʍѳʍ đєʌє ϯʙѳѥ ʍѧϯƀ єѣѧʌ ѳʜѧ πⱀѳҁϯѳ ʜє χѳϯєʌѧ ϯⱀѧʙʍџⱀѳʙѧϯƀ ϯʙѳѥ đєϯҁκƴѥ πҁџχџκƴ',
'𓌵👁️‍🗨️ ѣʌᴙϯƀ ɯѧκѧʌ ϯƀӀ ʜє ʙκƴⱀџʙѧєɯƀ ᴙ ѱѧҁ ϯєѣᴙ ϯƴϯ κ ҁϯєʜє πⱀџѫʍƴ џ ϯѧκ ѳϯⱀѧχѧѥ κѧκ ϯєѣє єѱё ʜє ҁʜџʌѳҁƀ єѣѧʜʜƀӀӣ πџӡđѳʌџӡ đѧʙѧӣ ѳϯʙѧʌџʙѧӣ ѳϯ ҁѥđѧ',
'𓌵👁️‍🗨️ πѳκѧ ᴙ ϯƴϯ κƴⱀџʌ ᴙ πѳđƴʍѧʌ ʜѧđ ϯєʍ ʍѳѫєϯ ѳҁϯѳʜѳʙџϯƀҁᴙ єѣѧϯƀ ϯʙѳѥ ʍѧϯƀ ʜƴ ϯѧκѧᴙ ґʌƴπѧᴙ ʍƀӀҁʌƀ ᴙ ҁⱀѧӡƴ єё ѳϯѳґʜѧʌ ѳϯ ҁєѣᴙ џ πѳɯёʌ єѣѧϯƀ ϯʙѳѥ ʍѧϯƀ',
'𓌵👁️‍🗨️ πѳκѧ ϯƀӀ ҁϯѧʜѳʙџʌҁᴙ κⱀєπӌє ӌϯѳѣƀӀ χѳϯƀ κѧκ ϯѳ đѧϯƀ ʍʜє ѳϯπѳⱀ ᴙ ƴѫє ƴҁπєʌ ϯʙѳєӣ ʍѧϯєⱀџ ʜѧ κʌƀӀκ ⱀѧӡ 67786 đѧϯƀ đѧʙѧӣ ѣʌᴙϯƀ џđџ ҁѥđѧ ӌѧπѧʌѧχѧ ϯє đѧʍ',
'𓌵👁️‍🗨️ πѳ ґєʜʜѳʍƴ ѻѧκϯѳⱀƴ ʙ ʙѧɯєӣ ҁєʍƀєџ ᴙ ґʌѧʙʜƀӀӣ ʙєđƀ ϯѳϯ κϯѳ єѣєϯ ϯʙѳѥ ʍѧϯƀ ϯѳϯ џ đєⱀѫџϯ ʙʌѧҁϯƀ ʙєⱀʜѳ ӡʜѧӌџϯ ᴙ ҁѧʍєҵ єπϯ ϯʙѳѥ ʍѧϯƀ',
'𓌵👁️‍🗨️ ϯє ӌё ӡѧʜᴙϯƀҁᴙ ʜє ӌєʍ ʙѳϯ ʍʜє єҁϯƀ ӌєʍ ѱѧҁ πѳӣđƴ κ ϯʙѳєʍƴ ѳϯҵƴ џ πѳκѧѫƴ ʙџđєѳ ґđє ϯʙѳᴙ ʍѧϯƀ ѳϯҁѧҁƀӀʙѧʌѧ ʍʜє χѳϯᴙ ϶ϯѳϯ πєϯƴχ ʙҁє ⱀѧʙʜѳ єӣ ʙҁё πⱀѳҁϯџϯ',
'𓌵👁️‍🗨️ ʜƴ ѫє đѧʙѧӣ πѳӣʍџ ӌϯѳ ϯƴϯ ϯєπєⱀƀ ʍƀӀ ҁ ϯѳѣѳӣ đѳ ʜѳӌџ ѣƴđєʍ ϯʙѳєӣ ʍѧϯєⱀџ πџӡđєʜκƴ πѳđѫџґѧϯƀ ʙєđƀʍѧ єѣѧʜʜѧᴙ ӌє ҁϯѳџɯƀ ѣєʜӡџʜ ʜєҁџ',
'𓌵👁️‍🗨️ ⱀѧđџ ʙѧҁ ᴙ ϯƴϯ єѱє πѳҁџѫƴ ʙєđƀ  ϯʙѳᴙ ʍѧϯƀ ϯѳѫє ʜѧ ʍєʜᴙ ҁʍѳϯⱀџϯ џ ʜє ҁѳѣџⱀѧєϯƀҁᴙ ƴχѳđџϯƀ ᴙ ϯѧκ πѳʜџʍѧѥ ҁєґѳđʜᴙ ѣƴđєϯ ʙєҁєʌѳ',
'𓌵👁️‍🗨️ đѧ κѳʜєӌʜѳ ᴙ ʜє ʌѥѣʌѥ ϯʙѳѥ ʍѧϯƀ ʜƴ πҁѳʍϯⱀџ ʜѧ 100ⱀƴѣʌєӣ ᴙ πѳκƴπѧѥ πѧӌκƴ ҁџґѧⱀєϯ ѧ ϯƴϯ ӡѧ ҁϯѳ ⱀƴѣʌџκѳʙ ᴙ κƴπџʌ ϯʙѳѥ ʍѧϯƀ ʙ ⱀѧѣҁϯʙѳ ʜѧʙҁєґđѧ',
'𓌵👁️‍🗨️ ⱀѧҁκџđѧѥ ϯƴϯ πѳ πʌєʜϯƴ ϯʙѳѥ ʍѧϯƀ ʙʜѧϯƴⱀє ϯєⱀѳⱀѳџҁϯƀӀ πⱀџɯʌџ џ ʜє πѳʜᴙʌџ πѳӌєʍƴ ϯʙѳᴙ πџӡđѧ ϯѳӌκƴ ѣ ʜѧκⱀƀӀʌѧ ᴙ ϯѳѫє ѣƀӀʌ ʙ ѧχƴє πѳⱀѫѧʌџ đѧ ⱀѧӡѳɯʌџҁƀ',
'𓌵👁️‍🗨️ ʙѳϯ đѧʙѧӣ ʜє ѣƴđєʍ ґʙѳѳⱀџϯ ʜѧ ϯєʍƴ πѳʌџϯџκџ ʍƀӀ џ ϯѧκ ӡʜѧєʍ ӌϯѳ ϯʙѳᴙ ʍѧϯƀ ϯѳѫє ʙ ʜєӣ ʜє ɯѧⱀџϯ πⱀѳҁϯѳ ʌѥѣџϯ ҁѳҁѧϯƀ χƴӣ ʜƴ ҁѳҁёϯ џ ҁѳҁёϯ χƴʌє',
'𓌵👁️‍🗨️ Ϯʙѳᴙ ʍѧϯƀ ϶ґѳџҁϯκѧ πѳ ѳϯʜѳɯєʜџѥ κ ϯʙѳєʍƴ ѣѧϯџ ʙєđƀ ʙҁєʍ ʜѧʍ ѳʜѧ ҁѳҁёϯ ѧ ѣѧϯџ đѧёϯ ϯѳʌƀκѳ ʍѳχʜѧϯκƴ πѳʌџӡѧϯƀ ʍƀӀ ⱀєɯџʌџ ӌϯѳ ϶ϯѳ ʜє πⱀѧʙџʌƀʜѳ џ ѳϯѣџʌџ єӣ ɯѧʍѧⱀѳʙ ӡѧ ϶ϯѳ ϯєπєⱀƀ ѳʜѧ ҁѳҁєϯ ϯʙѳєʍƴ ѣѧϯџ κѧκ џ ʜѧʍ ʜѳ ϯʙѳӣ ѣѧϯᴙ ϯѳѫє πѧⱀƴ ⱀѧӡ ʜѧʍ ҁѳҁѧʌ ʜѳ ϶ϯѳ ƴѫє đⱀƴґѧᴙ џҁϯѳⱀџᴙ.',
'𓌵👁️‍🗨️ Ɓѳ ʙⱀєʍᴙ ʙѳӣʜƀӀ ϯʙѳᴙ ʍѧϯƀ ϯѳʌƀκѳ ʜѧɯџʍџ ӡѧʌƴπѧʍџ џ ҁπѧҁѧʌѧҁƀ ʜє πѳʜџʍѧѥ ӡѧӌєʍ ʜѳ ϯєⱀʌѧ ʜѧɯџ χƴџ ҁѧʌѳʍ џ ʙҁє ҁʌџӡƀӀʙѧʌѧ ӡʜѧєɯƀ ʙⱀѳđє ѳʜѧ ʜѧєđѧʌѧҁƀ ϯѧκ џ ɯʌџ ґѳđѧ ѧ ϯʙѳᴙ ʍѧϯƀ đѧѫє πѳҁʌє ϯᴙѫєʌѳґѳ ʙⱀєʍᴙ ϯѧκ џ ҁѳҁєϯ ʜѧʍ κѧκ ҁѳѣѧκѧ πѧʙʌѳʙѧ ʙʜѧϯƴⱀє ʙ πⱀџʙƀӀӌκƴ ʙѳɯʌѳ.',
'𓌵👁️‍🗨️ Δѧѫє ∏џѻѧґѳⱀ ҁѳӡđѧʌ ϯєѳⱀєʍƴ ʜѧ ҁӌєϯ ϯʙѳєӣ ʍѧϯєⱀџ єҁʌџ ϯʙѳᴙ ʍѧϯƀ ʜѧʍ ʜє πѳҁѳҁєϯ ҁ ʜєӣ πѳ ʌѥѣѳʍƴ ӌϯѳ ʜџѣƴđƀ ҁʌƴӌџϯƀҁᴙ џ ϯєπєⱀƀ ѳʜѧ ϶ϯѳґѳ ѣѳџϯƀҁᴙ џ ѳϯҁѧҁƀӀʙѧєϯ ʜѧʍ κѧѫđƀӀӣ đєʜƀ џ ʙҁє ҁ ʜєӣ χѳⱀѳɯѳ џ ʙҁє ⱀѧđƀӀ ʙѳѣѱєʍ.',
'𓌵👁️‍🗨️ Ɓκѧӌџʙѧᴙ ϯʙѳѥ ʍѧϯƀ џʜѻѳⱀʍѧҵџєӣ ӌϯѳ ѳʜѧ ɯʌѥχѧ ʍƀӀ ʙѳʙҁє ʜє πƀӀϯѧєʍҁᴙ єё ѳҁκѳⱀѣџϯƀ ʍƀӀ ґѳʙѳⱀџʍ ʌџɯƀ πѳ ѻѧκϯѧʍ ⱀѧӡʙє ѣƀӀ ϯƀӀ ʜє χѳϯєʌ ѳϯπєⱀđѳʌџϯƀ ϯѧκƴѥ ґʜџʌƀ κѧκ ѳʜѧ χѳϯєʌ ѣƀӀ κѳʜєӌʜѳ ʜѳ ϯƀӀ єѱё ʙєⱀџɯƀ ӌϯѳ ѳʜѧ ϯʙѳᴙ ʍѧʍѧ.',
'𓌵👁️‍🗨️ ∏ѳ πⱀџⱀѳҁϯƴ ҁџʌ ʙ ʜѧɯџχ ӡѧʌƴπѧχ ʍƀӀ ѣєѫџʍ κ ϯʙѳєӣ ʍѧϯєⱀџ џ ѳʜѧ ҁ πѳⱀѳґѧ ʜѧӌџʜѧєϯ ϯѳⱀґѳʙѧϯƀ ҁʙѳџʍ ϯєʌѳʍ πєⱀєđ ʙҁєʍџ ʜѧʍџ џ ӡʜѧєɯƀ ʍƀӀ ʜє ӌєґѳ єӣ ʜє πʌѧϯџʍ ѳʜѧ ʜѧʍ ʙ đѳʌґ ӡѧџҁƀӀʙѧєϯ єҁʌџ ϯѧκ πѳҁӌџϯѧϯƀ ʍƀӀ ҁ ϯʙѳєӣ ʍѧϯєⱀƀѥ ʜє ⱀѧҁπʌѧϯџʍҁᴙ ʜѳ κϯѳ ҁκѧӡѧʌ ӌϯѳ ʍƀӀ ѳϯđѧđџʍ.',
'𓌵👁️‍🗨️ Ҟѳґđѧ πⱀѳџҁχѳđџϯ ҁχѳđᴙκ ѣѧʜđџϯѳʙ ϯʙѳᴙ ʍѧϯƀ ʙҁєґđѧ ϯѧʍ ѧ ӡʜѧєɯƀ ӡѧӌєʍ πѳϯѳʍƴ ӌϯѳ ѣѧʜđџϯƀӀ ʙѳ ʙⱀєʍᴙ ʙҁϯⱀєӌ ʜѧπⱀᴙѫєʜƀӀ ѳѣҁƴѫđѧᴙ ҁʙѳџ đєʌѧ џ ϯʙѳᴙ ʍѧϯƀ ⱀѧҁʌѧѣʌᴙєϯ џχ ѳϯҁѳҁѳʍ ʜє ⱀѧӡƴ єѱё ґđє ѣƀӀʌѧ ϯʙѳᴙ ʍѧϯƀ ʜє ѣƀӀʌѳ πєⱀєҁϯⱀєʌκџ.',
'𓌵👁️‍🗨️ Ϯʙѳᴙ ʍѧϯƀ єѣѧʜʜѳє ѫџʙѳϯʜѳє џ ӡʜѧєɯƀ ᴙ ʜє ѫєʌєѥ ӌϯѳ ϯѳґđѧ ʜѧҁѧʌ єӣ ʜѧ єѣʌєϯ ʙєđƀ ϶ϯѧ πѧⱀѧɯʜџҵѧ ⱀєɯџʌѧ ҁκѧӡѧϯƀ ӌϯѳ ϯєπєⱀƀ ʜє κѳʍƴ џӡ ʜѧҁ ҁѳҁѧϯƀ ʜє ѣƴđєϯ ƴ ʜєё ʜѳʙѧᴙ ѫџӡʜƀ џ ʙҁє đєʌѧ ʜє ʜƴ ϶ϯѳ ѣʌᴙđѳʙκѧ ѳχƴєʌѧ ҁѳґʌѧҁџҁƀ.',
'𓌵👁️‍🗨️ ∏ѳҁϯєπєʜʜѳ ϯʙѳᴙ ʍѧϯƀ πⱀєʙⱀѧѱѧʌѧҁƀ ʙ ʜѳⱀʍѧʌƀʜƴѥ ѫєʜѱџʜƴ ʜѳ ʙ ѳđџʜ ʍѳʍєʜϯ ѳπᴙϯƀ ҁѳⱀʙѧʌѧҁƀ џ ʜѧӌѧʌѧ đѧʙѧϯƀ ҁʙѳѥ πџӡđƴ ʜѧ ⱀѧӡⱀƀӀʙ ʙҁєʍƴ ⱀѧӣѳʜƴ ϯƀӀ ʙʜѧϯƴⱀє χѳӌєɯƀ єё ҁєӣӌѧҁ ʙƀӀҁϯѧʙџϯƀ κѧκ κƴʌƀϯƴⱀʜƴѥ ѫєʜѱџʜƴ χѳϯᴙ ҁѧʍ ʙџđєʌ ӌϯѳ ѳʜѧ ʜѧɯџ χƴџ ʙ ҁʙѳӣ ⱀѳϯ πⱀѳπџχџʙѧʌѧ.',
'𓌵👁️‍🗨️ Ҟѳґđѧ ϯƀӀ πєⱀʙƀӀӣ ⱀѧӡ πⱀџɯєʌ κ ʜѧʍ џ ⱀѧҁκѧӡƀӀʙѧʌ ʜѧʍ πⱀѳ ҁʙѳѥ ʍѧϯƀ џ ӌϯѳ ƴ ʜєё ѳϯʌџӌʜƀӀӣ πⱀѳєκϯ ѳ ѣѧʌґѳϯʙѳⱀџϯєʌƀʜѳҁϯџ ʍƀӀ đѧѫє πѳʙєⱀџʌџ ʜѳ πѳϯѳʍ πѳʜᴙʌџ ҁƴϯƀ πⱀєѳκϯѧ ӌϯѳ ѳʜѧ χѳđџϯ κ ѣєđʜƀӀʍ џ ҁѳҁєϯ џʍ ҁѳʙⱀɯєʜʜѳ ѣєҁπʌѧϯʜѳ ʍƀӀ ʙƀӀđʙџʜƴʌџ ϶ϯѳϯ πⱀѳєκϯ ʜѧ ⱀѧҁʍѳϯⱀєʜџᴙ.',
'𓌵👁️‍🗨️ ∏џӡđѧϯѳ κѳґđѧ ϯʙѳᴙ ʍѧϯƀ πⱀџѣєґѧϯƀ πѳҁѳҁѧϯƀ χƴџ ӡѧ πⱀѳҁϯѳ ϯѧκ πⱀџӡʜѧѥҁƀ џʜѳґđѧ ᴙ ҁџѫƴ ƴ ѳκʜѧ џ ѫđƴ κѳґđѧ ϯʙѳᴙ ʍѧϯƀ ⱀπџѣєѫџϯ ɯƴӌƴ κѳʜєӌʜѳ ѳʜѧ џ ϯѧκ κѧѫđƀӀӣ đєʜƀ ƴ πѳⱀѳґѧ κѳґđѧ ᴙ єӣ χƴёʍ ґʌѧʜđƀӀ πѳπⱀѧʙʌѥ ѧ ϯƀӀ đƴʍѧʌ єё ʙѳѣѱє κϯѳ ϯѳ ѫđёϯ.',
'𓌵👁️‍🗨️ Ϯʙѳᴙ ʍѧϯƀ ѣƀӀʌѧ ґџʍʜѧҁϯκѳӣ џ ҁϯⱀєʍџʌѧҁƀ κ ʙєⱀɯџʜѧʍ πѳκѳⱀєʜџᴙ ҁπѳⱀϯѧʍ ʜѳ πѳϯѳʍ ѳʜѧ πѳʜᴙʌѧ ӌϯѳ єӣ ʜѧχƴӣ ϶ϯѳ ʜє ʜѧđѳ џ ⱀєɯџʌѧ џҁπѳʌƀӡƀӀʙѧϯƀ ҁʙѳѥ ⱀѧҁϯᴙѫκƴ đʌᴙ ʜѧҁ ҁπѧҁџѣѳ ѣѳʌƀɯѳє єӣ ӡѧ ϶ϯѳ ʍƀӀ ʜѧʙҁєґđѧ ӡѧπѳʍʜџʍ єё đѳѣⱀѳϯƴ џ ӡѧ ϶ϯѳ πѳđκџʜєʍ єӣ ʜѧ χʌєѣ.',
'𓌵👁️‍🗨️ ∏ѧⱀѧʌєʌƀʜѧ ϯʙѳᴙ ʍѧϯƀ єѱё ƴҁπєʙѧʌѧ ⱀѧѣѳϯѧϯƀ ʙ ѣѧʜκє џ ʙⱀѳđє ʜєπʌѳχѳ ӡѧⱀѧѣѧϯƀӀʙѧʌѧ ʜѳ κѳґđѧ ʍƀӀ ӡѧʌєϯєʌџ ʜѧ đʙџѫ ҁ πѧҵѧʜѧʍџ ʜѧӌѧʌџ ʙƀӀʜѳҁџϯƀ ѣѧѣκџ ϯʙѳᴙ ʍѧϯƀ πѳπѧʌѧ πѳđ ʜѧɯ πⱀџҵєʌ ʜѳ ѳʜѧ ѣƀӀʌѧ ʜє πⱀѳϯџʙ ʜѳ ʜѧ πⱀѳѱѧʜџᴙ πѳπⱀѳҁџʌѧ πѳҁѳҁѧϯƀ ʙєđƀ ѳʜѧ ӡʜѧʌѧ ӌϯѳ ѣѳʌƀɯє ʜє ƴʙџđџϯ ʜѧҁ.',
'𓌵👁️‍🗨️ Ƥѧҁϯѳᴙʜџє ʜє ʙʌџᴙєϯ ʜѧ ʌѥѣѳʙƀ ʌѥđєӣ κ đⱀƴґ đⱀƴґѧ ʜѳ ϯʙѳᴙ ʍѧϯƀ ʜє џҁκʌѥӌєʜџᴙ πѳκѧ ϯʙѳӣ ѣѧϯᴙ ʙ κѳʍѧʜđџⱀѳʙκѧχ ѳʜѧ πⱀџѣєґѧєϯ κѳ ʍʜє џ ґʌѳϯѧєϯ ʜѧɯџ χƴџʜƀӀ ʜƴ ӌϯѳ ӡѧ ѣⱀєđ ѧ ѣѧϯџ πџɯєϯ ӌϯѳ ҁκѳⱀѧ ƴ ʜџχ ʙҁє ҁʌƴӌџϯƀҁᴙ ѣʌᴙ ᴙ ѣƀӀ ϶ϯѳӣ κⱀƀӀҁє ґʌѳϯκƴ ҁʙєⱀʜƴʌ ʜѳ ҁѳҁєϯ ʜѳⱀʍ.',
'𓌵👁️‍🗨️ Ƥѧѻѧ϶ʌƀ ʜѧ ҁӌєϯ ϯʙѳєӣ ʍѧϯєⱀџ ʜѧπџҁѧʌ κѧⱀϯџʜƴ ϯʙѳᴙ ʍѧϯƀ ʙʍєҁϯє ҁ χƴєʍ ʜѧ ѻѳʜє ѣєґѧєϯ πѳ πѳʌᴙʍ ʙєđƀ ϯѧκ џ ѣƀӀʌѳ ѳʜѧ єѱє đѳ ʜѧɯєӣ ϶ⱀƀӀ ѳϯҁѧҁƀӀʙѧʌѧ đџʜѳӡѧʙⱀѧʍ ѧ ᴙ ϯѳ đƴʍѧʌ πѳӌєʍƴ ʙ єё ⱀѳϯ πѳ ҁʌƴӌѧӣʜѳҁϯџ ӡѧχєѧʌ ҁѧʍѳҁʙѧʌ ϯƀӀ ϯѳѫє ѳχƴєʌ đѧ.',
'𓌵👁️‍🗨️ Ҟѳґđѧ ᴙ ƴҁϯⱀѧџʙѧʌ πџⱀ ʙѳ ʙⱀєʍᴙ ӌƴʍƀӀ ҁѳ ҁʙѳџʍџ đⱀƴӡƀᴙʍџ πⱀѳҁϯƀӀє ҁʍєⱀϯʜƀӀє ϯⱀѳʌʌџ πѳґџѣѧʌџ ѧ ʍƀӀ ӡѧʌџʙѧʌџҁƀ ʙџʜѳʍ џ ϯƴϯ πⱀџѣєѫѧʌѧ ϯʙѳᴙ ʍѧϯƀ џ πѳπⱀѳҁџʌѧҁƀ κ ʜѧʍ ӡѧ ѳϯҁѳҁ ѳʜѧ ѳϯҁѳҁѧʌѧ κѳʜєӌʜѳ ʙҁєʍƴ ӡѧʍκƴ ʜѳ ϯƀӀ ѫє πѳʜџʍѧєɯƀ ӌϯѳ ʍƀӀ єё ʜє πƴҁϯџʌџ.',
'𓌵👁️‍🗨️ ⴼє ѣєⱀџ πⱀџʍєⱀ ҁѳ ҁʙѳєӣ ʍѧʍƀӀ ʙєđƀ ʙѳѣѱєʍ ϯѳ ӌєʍƴ ѳʜѧ ʍѳѫєϯ ϯєѣᴙ ʜѧƴӌџϯƀ πѳҁѳҁѧϯƀ ӡѧ ѣџʌєϯ ʙ ѣƴđƴѱєє ʜєϯ ʍѧʌѳӣ ҁϯⱀєʍџҁƀ ʙʙєⱀχ ѧ ʍƀӀ πѳκѧ πѳҁџđџʍ џ πѳҁʌƴɯѧєʍ ⱀѧҁκӡѧƀӀ ϯʙѳєӣ ʍѧʍκџ ӌϯѳ ѳʜѧ ʜѧҁ ʌѥѣџϯ џ ϯѳʌƀκѳ џӡ ӡѧ ϶ϯѳґѳ ҁѳҁєϯ ʙҁєʍ ʜѧʍ.',
'𓌵👁️‍🗨️ Џđёϯ ʜѧѣѳⱀ ʙ ⱀᴙđƀӀ ʍѳʌѳđƀӀχ ѣѳӣҵѳʙ đʌᴙ ѳϯπⱀѧʙκџ џχ ʜѧ ʙѳӣʜƴ ʙ ӌєӌʜѥ ʜѳ ѣʌᴙϯƀ ʜѧχƴӣ ϯƴđѧ πѳπєⱀʌѧҁƀ ϯʙѳᴙ ʍѧϯƀ єє πʌѧʜ κѳґđѧ ʜѧɯџ ѣƴđƴϯ ѳϯѣџʙѧϯƀ ѧϯѧκџ ѣѳєʙџκѳʍ ѳʜѧ ѣƴđєϯ џχ ѳϯʙʌєκѧϯƀ ѳϯҁѳҁѳʍ ϯѳґđѧ ѣѳєʙџκџ ⱀѧӡđѳѣⱀᴙϯƀҁᴙ џ ʜѧɯџ џχ ҁʍѳґƴϯ ʙƀӀʜєҁϯџ.',
'𓌵👁️‍🗨️ ⴼє ӌєґѳ ʜє πѳđєʌѧєɯƀ ϯʙѳᴙ ʍѧϯƀ ѳπᴙϯƀ ⱀєɯџʌѧ ʜѧѣƴχѧϯƀҁᴙ κѧκ ҁʙџʜѳϯѧ џ ҁєӣӌѧҁ ϯѧʜҵƴєϯ ʜѧ ѣѧⱀʜѳӣ ҁϯѳӣκє ᴙ πѳπƀӀϯѧʌҁᴙ ϯѳⱀʍѳӡʜƴϯƀ єё ʜѳ ʜє ӌєґѳ ʜє ʙƀӀɯʌѳ ϶ϯѧ ɯѧʌѳɯѳʙκѧ ѳπᴙϯƀ πѳʌєӡʌѧ ʜѧ ҁϯѳʌ ᴙ єё πⱀџҁϯⱀєʌџʌ ʜѳ ʜє ʙѳʌʜƴӣҁᴙ πѳҁѳҁѧϯƀ ӡѧχѳӌєϯ ʙҁϯѧʜєϯ.',
'𓌵👁️‍🗨️ Ϯʙѳᴙ ʍѧʍѧ ʌѥѣџϯ πєӌƀ πџⱀѳґџ đѧ џ ʙѧɯѧ ҁєʍƀᴙ џχ ʙⱀѳđє κѧκ ʌѥѣџϯ ʜѳ ӡʜѧєɯƀ κѧκѳӣ ҁєκⱀєϯʜƀӀӣ џʜґⱀєđџєʜϯ ʙ ϶ϯџχ πџⱀѳґѧχ ʜѧɯѧ ҁ πѧҵѧʜѧʍџ ҁπєⱀʍѧ ѳʜѧ ӡѧπⱀѧʙʌᴙєϯ єӣ πџⱀѳґ џ ʙƀӀ ҁʙџʜƀџ єѣѧʜʜƀӀє πѳѫџⱀѧєϯє ʜѧɯџ ѳϯχѳđƀӀ πʌєʙѳκ ʙ єѣѧʌѳ ϯєѣє ӌƴχѧʜ.',
'𓌵👁️‍🗨️ Ҟѳґđѧ ϯʙѳᴙ ʍѧϯƀ πѳӡʙѧʌѧ πєⱀєƴҁϯѳʜѳʙџϯƀ ʙџʜđƴ ᴙ πѳđƴʍѧʌ ӌϯѳ ѳπᴙϯƀ ϶ϯѧ ϯƴπѧᴙ πџӡđѧ ӌϯѳ ϯѳ ҁʌѳʍѧʌѧ πⱀџɯєʌ ѧ ϯѧʍ ϯʙѳᴙ ґѳʌѧᴙ ʍѧʍѧɯѧ ҁϯѳџϯ ʜѳ ᴙ κѧκ єѣѧʜƴʌ єӣ ʌєѱѧ џ ϯƴχѧʜƴʌ ҁ ʜѳґџ ᴙ ʙѳѣѱє ʙ ѻѧʌѧƴϯ χѳϯєʌ πѳџґⱀѧϯƀ ѧ ʜє ϶ϯƴ ҵƀӀґѧʜκƴ ѳѣⱀѧѣѧϯƀӀʙѧϯƀ.',
'𓌵👁️‍🗨️ ∏ѳ ҁʌƴχѧʍ ϯʙѳᴙ ʍѧϯƀ ҁѳҁѧʌѧ Ґџϯʌєⱀƴ κѧκ ѳʜѧ ґѳʙѳⱀџʌѧ єӣ πѳʜⱀѧʙџʌѧҁƀ єґѳ џđєᴙ ѳ ӡѧχʙѧϯє ʍџⱀѧ ʜѳ єё ѳѣʌѳʍѧʌџ џ πѳҁʌє ϶ϯѳґѳ ѳʜѧ ƴѫє ҁѳҁѧʌѧ Ҁϯѧʌџʜƴ џ ϯƴϯ ѳʜѧ ѳπᴙϯƀ ѳѣʌѳʍѧʌѧҁƀ џ πⱀџɯʌѧ κѳ ʍʜє ӌƴʙҁϯʙƴѥ ҁєѣᴙ Ґєʜєⱀѧʌџҁџʍƴҁѳʍ.',
'𓌵👁️‍🗨️ Ϯʙѳѥ ʍѧʍѧɯƴ ʜє ӡѧѣѳϯџϯ đѧѫє ϯѳ ӌϯѳ ϯƀӀ ҁџđџɯƀ đѳʍѧ ґѳʌѳđʜƀӀӣ ѫџʙѳϯʜѳє єѣѧʜʜѳє ѳʜѧ πⱀџѣєґѧєϯ κ ʜѧʍ џ ʙ ґѳʌѳʙє ƴ ʜєє ʍƀӀҁʌƀ ҁѳҁѧϯƀ ҁѳҁѧϯƀ ʜѳ ʍƀӀ єӣ ʙⱀπѧʙџʌџ ʍѳӡґџ џ πєⱀєđѧʌџ єӣ ʜєѣѳʌƀɯѳє κѳʌџӌєҁϯʙѳ єđƀӀ ʙ ѣѧʜκє ϯѧʍ єҁʌџ ӌϯѳ ʜѧɯѧ ҁπєⱀʍѧ πѳχѧʙѧӣ ѣⱀѧϯєҵ.',
'𓌵👁️‍🗨️ Ҟѳґđѧ ᴙ πѳđⱀѧʌҁᴙ џӡ ӡѧ ϯʙѳєӣ ʍѧʍƀӀ ϶ϯѳ ѣƀӀʌѳ ҁѧʍѧᴙ ґʌƴπѧᴙ ѳɯџѣκѧ ʙ ʍѳєӣ ѫџӡʜџ ʙєđƀ πѳϯѳʍ πѧҵѧʜƀӀ ʍʜє ѳѣъєҁʜџʌџ κϯѳ ѳʜѧ џ ӌєʍ ѫџʙєϯ ʜѳ ʍƀӀ πѳҁʍєᴙʌџҁƀ џ đⱀƴѫʜѳ đѧʌџ єӣ ʜѧ ⱀѳϯѧ ѣʌᴙ ѧ ϯѧκ ʙҁє χѳⱀѳɯѳ ʜѧӌџʜѧʌѳҁƀ.',
'𓌵👁️‍🗨️ Ҟѳґđѧ ϯʙѳᴙ ʍѧϯƀ ʜѧⱀƴɯџʌ πⱀѧʙџʌѧ đѳѳѫʜѳґѳ đʙџѫєʜџᴙ ʍєʜϯƀӀ єӣ χѳϯєʌџ ʙƀӀπџҁѧϯƀ ɯϯⱀѧѻ ʜѳ ϶ϯѧ πƴϯѧʜѧ ʍєҁϯѳ ϯѳґѳ ӌϯѳѣƀӀ ѳϯđѧϯƀ κѧκџє ϯѳ 1000ⱀƴѣ. ⱀєɯџʌѧ ӌϯѳ ѣƴđєϯ ҁѳҁѧϯƀ ʙҁєʍƴ ƴӌѧҁϯκƴ đѳ κѳʜҵѧ ҁʙѳєӣ ѫџӡʜџ џ đѧѫє ʜє πⱀєđџʜϯѳʙѧϯƀ ʜѧ ѳϯκѧӡ.',
'𓌵👁️‍🗨️ Ϯʙѳᴙ ʍѧϯƀ ӡʜѧʍєʜџϯѧ ʙ ҁѻєⱀє πⱀѳϯџϯƴҵџџ єҁʌџ ⱀєӌƀ ӡѧχѳđџϯ ѳ ϯѳʍ ʜѧ κѳґѳ πѳϯⱀѧϯџϯƀ 500ⱀƴѣ. ϯʙѳᴙ ʍѧϯƀ ʍџґѳʍ ӡđєҁƀ џ ӡʜѧєɯƀ ӌϯѳ ᴙ ʙєⱀѥ ʙ ϯѳ ӌϯѳ ѳʜѧ κѳґđѧ ʜџѣƴđƀ πѳʙƀӀҁџϯ ҁϯѧʙκџ џ ƴѫє ʜє ѣƴđєϯ χƴᴙⱀџϯƀ ҁʙѳџʍ ⱀϯѳʍ ӡѧ κѳπєӣκџ.',
'𓌵👁️‍🗨️ ϮƀӀ ϯѧκ ӡѧʙєʌҁᴙ ʜѧ ҁӌёϯ ϯѳґѳ ӌϯѳ ᴙ ҁκѧӡѧʌ ӌϯѳ ϯʙѳᴙ ʍѧʍѧʜᴙ ɯʌѥχѧ ϯƀӀ ʜє πⱀџʜџʍѧӣ ѣʌџӡκѳ κ ҁєⱀđҵƴ ʙєđƀ ᴙ ʜє χѳϯєʌ ҁџʌƀʜѳ πѳđπѳⱀϯџϯƀ єӣ ⱀџπƴϯѧҵџѥ ʜѳ ϯƀӀ ҁѧʍ πѳđƴʍѧӣ ѣƴđєϯ ʌџ ʜѳⱀʍѧʌƀʜѧᴙ ѫєʜѱџʜѧ ӡѧ ϯѥⱀєʍʜƀӀӣ πѧёκ ƴ ʙҁєґѳ ⱀѧӣѳʜѧ ҁѳҁѧϯƀ.',
'𓌵👁️‍🗨️ Ϯʙѳѥ ʍѧϯƀ ʜѧӡƀӀʙѧʌџ πєʙџҵєӣ ʜѳ ʙҁє џʍєʜџʌѳҁƀ χѳϯᴙ ʜє ҁκѧѫƴ ӌϯѳ ҁџʌƀʜѳ ϯєπєⱀƀ ʍєҁϯѳ ϯѳґѳ ӌϯѳѣƀӀ πєϯƀ ʙ ʍџκⱀѳѻѳʜ ѳʜѧ πѳёϯ ʙ ʜѧɯџ ӡѧʌƴπƀӀ џ ʜє κѳʍπʌєκҁƴєϯ πѳ ϶ϯѳʍƴ πѳʙѳđƴ ʜєƴѫєʌџ џӡ πєʙџҵƀӀ πѳʌƴӌџʌѧҁƀ ѣѳґџʜᴙ πⱀѳҁϯџϯƴҵџџ.',
'𓌵👁️‍🗨️ ⴼє ʍѳѫєϯ ѣƀӀϯƀ ӌϯѳѣƀӀ ϯʙѳѥ ʍѧϯƀ єѣѧʌџ ʙҁє ϯƀӀ πѳđƴʍѧʌ ʙ ѳđџʜ đєʜƀ џ ⱀєɯџʌ ҁѧʍ ϶ϯѳ πⱀѳʙєⱀџϯƀ κѳґđѧ ϯƀӀ πⱀѳҁʌєđџʌ ӡѧ ʜєӣ ʜє ƴҁπєʌ πѳʙєⱀʜƴϯƀҁᴙ κѧκ єё đⱀѧʌџ πѳđ 10 ӌєʌѳʙєκ ʜє πⱀѳɯʌѳ џ ʍџʜƴϯƀӀ ϯƀӀ ⱀѧӡѳӌєⱀѳʙѧʌҁᴙ ʙ ҁʙѳєӣ ʍѧϯєⱀџ.',
'𓌵👁️‍🗨️ ∏ѳӡʙѳʜџ ʍʜє κѳґđѧ ӡѧχѳӌєɯƀ ѳϯđѧϯƀ ҁʙѳѥ ʍѧϯƀ κѧκ πѳđѧⱀѳκ πѳϯѳʍƴ ӌϯѳ ʍƀӀ ϯƴϯ πѳđƴʍѧʌџ џ ⱀєɯџʌџ ӌϯѳ ʜѧ ʜєӣ ʍѳѫʜѳ κⱀƴϯџϯƀ ʜєχƴёʙƀӀє ѣѧѣκџ ʙєđƀ πѳκѧ єё ѳӌκѳ đєⱀѣѧʜџϯ ѣєҁπʌѧϯʜѳ ѧ ʍƀӀ πѳҁϯѧʙџʍ ҵєʜџκ ʜє ʙѳʌʜƴӣҁᴙ πѳ ѣѧѣκѧʍ đѳґѳʙѳⱀџʍҁᴙ.',
'𓌵👁️‍🗨️ Ҟѳґđѧ ϯƀӀ ʙƀӀҁџⱀѧєɯƀҁᴙ ӌϯѳ ϯʙѳᴙ ʍѧϯƀ ҁπџϯ đѳʍѧ џ ʍƀӀ єё ϯѳӌʜѳ ʜє єѣёʍ ϯƀӀ ѳɯџѣѧєɯƀҁᴙ ϯʙѳєӣ ʍѧϯєⱀџ đѳҁϯѧϯѳӌʜѳ ҁʙџҁϯѧʜƴϯƀ џ ѳʜѧ ϯƴϯ ѫє ӡđєҁƀ ʍƀӀ ʜє ѣƴđєʍ ґѳʙѳⱀџϯƀ ӌєʍ ϯʙѳᴙ ʍѧϯƀ πⱀѳʍƀӀɯʌᴙєϯ πѳҁʌє ϶ϯѳґѳ ʙєđƀ ϯƀӀ ҁѧʍ ӡʜѧєɯƀ πⱀѧʙđƴ.',
'𓌵👁️‍🗨️ ⴼє ґⱀƴҁϯџ џ ϯʙѳᴙ ʍѧϯƀ κѳґđѧ ʜџѣƴđƀ ҁϯѧʜєϯ κѳⱀѳʌєʙѳӣ ʜѳ πѳκѧ ѳʜѧ ϯѳʌƀκѳ ⱀѧҁϯѳπϯѧʜѧᴙ ɯѧʌѧʙѧ κѳϯѳⱀƴѥ ʍѳѫєϯ πєⱀđѳʌџϯƀ κѧѫđƀӀӣ ɯκѳʌƀʜџκ ʜѳ ϶ϯѳ ʙҁє ʙⱀєʍєʜʜѳ ҁκѳⱀѳ ѳʜѧ ƴӣđёϯ ѳϯ ҁѥđѧ κѳґđѧ ӡѧⱀѧѣѳϯѧєϯ ҁєѣє ʜѧ πʌѧϯƀᴙ ʜѳ ʍʜє κѧѫєϯƀҁᴙ ѳʜѧ ʜѧҁ ʜѧєѣѧʌѧ ʜєʌƀӡᴙ ʜѧ πʌѧϯƀᴙ ⱀѧѣѳϯѧϯƀ 30 ʌєϯ.',
'𓌵👁️‍🗨️ ∏ⱀџʙєđƴ πⱀџʍєⱀ ʙѳϯ ҁʍѳϯⱀџ ƴ κѧѫđѳґѳ ʍѧʍƀӀ ҁџđᴙϯ đѳʍѧ џ ґѳϯѳʙᴙϯ ƴѫџʜ ϯʙѳᴙ ʍѧϯƀ πⱀѳҁϯѳ ѣєґѧєϯ џ πⱀѳҁџϯ ӌϯѳѣƀӀ єё χѳϯƀ κѧκ ϯѳ ѳϯπџӡđџʌџ ӡѧʌƴπѧʍџ ʜѳ ѳʜѧ ϯѳѫє ʜє πⱀѧʙѧ ѫѧʌκѳ ʍѧⱀѧϯƀ ҁʙѳӣ πѳʌѳʙѳӣ ѳⱀґѧʜ ѳѣ ϶ϯƴ πѳđҁϯџʌκƴ ҁѳґʌѧҁџҁƀ.',
'𓌵👁️‍🗨️ Ϯʙѳᴙ ʍѧϯƀ πⱀџχѳđџʌѧ ʜѧ πѳʌє ӌƴđєҁ ʜѳ ʍєҁϯѳ ϯѳґѳ ӌϯѳѣƀӀ κⱀƴϯџϯƀ ѣѧⱀѧѣѧʜ ⱀѧҁκⱀƴӌџʙѧʌџ єё џ ʜє πѳʙєⱀџɯƀ ҁєκϯѳⱀ πⱀџӡ ʜѧ ѣѧⱀѣѧʜє ϯʙѳᴙ ʍѧϯƀ đѳҁϯѧʌѧҁƀ κѳʌƀӀʙѧʜƴ џӡ Ɓѳⱀѳʜєѫѧ ʜєѳѫџđѧʜʜѳ ʜѳ ʙ κѧκѳӣ ϯѳ ʍєⱀє πⱀџᴙϯʜѳ ӌϯѳ ʍƀӀ єё ѣѳʌƀɯє ʜє ƴʙџđџʍ.',
'𓌵👁️‍🗨️ ⴼє ӡѧđџⱀѧӣ ʜѳҁ ʙєđƀ ϯƀӀ πѳʍʜџɯƀ κѳґđѧ ʍƀӀ đⱀѧʌџ ϯʙѳѥ ʍѧϯƀ πєⱀєđ ϯʙѳџʍџ ґʌѧӡѧʍџ ѧ ϯƀӀ ҁџđєʌ ӡѧѫѧʙɯџҁƀ ʙ ƴґѳʌ џ đѧѫє ʜєӌєґѳ ʜѧʍ ʜє ʍѳґ ѳϯʙєϯџϯƀ ʙєđƀ ҁѧʍ πѳʜџʍѧʌ ӌϯѳ ʍƀӀ єё ʜє ʜѧҁџʌѳʙѧʌџ ѧ ѳʜѧ ҁѧʍѧ ʜѧҁ πѳπⱀѳҁџʌѧ ʜѧƴӌџϯƀ ϯєѣᴙ ѫџӡʜџ.',
'𓌵👁️‍🗨️ Ҟѳґđѧ ϯƀӀ đєʌѧʌ ƴⱀѳκџ κʌѧҁҁє ʙ 4 ϯʙѳᴙ ʍѧϯƀ ƴѫє χƴʌџґѧʜџʌѧ ҁѳ ҁʙѳџʍ ѧʜѧʌѳʍ ϯƀӀ đƴʍѧєɯƀ κϯѳ ҁʍѳґ ҁєҁϯƀ ʜѧ 45ʌ. ѣƴϯƀӀʌƀ đѳ ѳҁʜѳʙʙѧʜџᴙ џ πѳπѧʌ ʙ κʜџґƴ ⱀєκѳⱀđѳʙ ґџʜєҁѳʙ κѳʜєӌʜѳ ϶ϯѳ ѣƀӀʌѧ ϯʙѳᴙ ʍѧϯƀ ѧ ϯƀӀ ʜѧđєᴙʌҁᴙ ӌϯѳ χѳϯƀ ʙ ϶ϯѳϯ ⱀѧӡ ʜє ѳʜѧ đѧ.',
'𓌵👁️‍🗨️ Ϯʙѳᴙ ʍѧϯƀ ѳϯҁѳҁѧʌѧ ӡѧ ѳѣⱀƀӀґѧʜʜƀӀӣ ʌєđєʜєҵ ʙ ʙѧґѳʜє ʍєϯⱀѳ πѳʜџʍѧєɯƀ ϯѧʍ ҁџđєʌџ ʌѥđџ џ ѳʜџ ʜѧʙєⱀʜѳ ʜє ѳӌєʜƀ χѳϯєʌџ ҁʍѳϯⱀєϯƀ ʜѧ ϶ϯƴ ӡѧʌƴπѳđⱀѧʜκƴ ʜѳ ʙƀӀѣѳⱀѧ ʜє ѣƀӀʌѳ ʙєđƀ ϯʙѳᴙ ʍѧϯƀ ʜѧҁѳӣӌџʙѧ џ χѳϯєʌѧ ӌϯѳѣƀӀ єё ʙџđєʌ κѧѫđƀӀӣ.',
'𓌵👁️‍🗨️ ҀʌƀӀɯƀ ʍѧⱀѧӡʍѧϯџκ єѣѧʜƀӀӣ, ϯƀӀ πѳʜџʍѧєɯƀ, ӌϯѳ πџӡđѧ ϯʙѳєӣ ʍѧϯєⱀџ ʍѳᴙ ʌџӌʜѧᴙ ҁѳѣҁϯʙєʜʜѳҁϯƀ џ џʍєʜʜѳ ᴙ ʍѳґƴ єѣѧϯƀ єє ҁκѳʌƀκѳ ϯѳʌƀκѳ ʍѳєӣ đƴɯє ƴґѳđʜѳ, ӌƴπѧκѧѣⱀѧ ϯƀӀ єѣѧʜѧᴙ?? ᴙ єѣѧʌ ϯʙѳѥ ʍѧϯƀ ʙ ʌєҁʜџӌєҁϯʙє ʜѧ đƴѣѳʙƀӀχ đѳҁκѧχ џ єє πџӡđѧ πⱀѳπѧʌѧ ҁʙєѫџʍ đєⱀєʙѳʍ, ʍѳđєʌƀ ҁπѳκѳӣʜѳ єѣѧɯџϯƀ κƴʜᴙκƴ єӣ ',
'𓌵👁️‍🗨️ ҀʌƀӀɯƀ єѣѧʜѧᴙ ϯƀӀ ҁƴκѧ ѫџʙʜѳҁϯƀ, ᴙ ѫє ҁєӣӌѧҁ ʙѳӡƀʍƴ ҁʙѳӣ χƴӣ ʙ ⱀƴκƴ џ ѣƴđƴ єѣѧɯџϯƀ џʍ πѳ ϯʙѳєӣ ϯƴπѳӣ ґѳʌѳʙє, ѳϯҁϯѧʌƀӀӣ ϯƀӀ ѧƴϯџҁϯ ҁƴκѧ, ᴙ ѫє ʙ ʜѧϯƴⱀє ʙ πџӡđє ϯʙѳʜӣ ʍѧʍѧɯџ πⱀѳҁʌѧʙџʌ ҁϯƴʌ đʌᴙ ҁʙѳєґѳ χƴᴙ, ӌϯѳѣƀӀ ѳʜ ʍѳґ πєⱀєđѳχʜƴϯƀ ʙѳ ʙⱀєʍᴙ єҁʌџ ҁ ϯʙѳєӣ ʍѧʍѧɯєӣ',
'𓌵👁️‍🗨️ ϮƀӀ πѳʜџʍѧєɯƀ ӌϯѳ πџӡđƴ ϯʙѳєӣ ʍѧϯєⱀџ ʜƴѫʜѳ ѳӌџҁϯџϯƀ ѳϯ ʙҁᴙκџχ ʙⱀєđʜƀӀχ ѣѧκϯєⱀџӣ ӡѧʌџʙ ѣєʌџӡʜѳӣ єє πџӡđƴ đѳ ҁѧʍѳґѳ κⱀѧᴙ, ѧ πѳϯѳʍ ϯєѣє πⱀџđёϯҁᴙ ҁѧʙκѳʍ ӌєⱀπѧϯƀ ϶ϯƴ ѫџѫƴ єѣѧʜƴѥ ӌϯѳѣƀӀ ѳκѳʜӌѧϯєʌƀʜѳ ӡѧκѳʜӌџϯƀ ϶ϯƴ πⱀѳҵєđƴⱀƴ',
'𓌵👁️‍🗨️ ꯌ ϯʙѳѥ ʍѧϯƀ єѣѧϯƀ πѳʜџʍѧєɯƀ πѳκѧ ϯƀӀ ҁπѧʌ κѧѫđƴѥ ʜѳӌƀ ʜџ ѳ ӌєʍ ʜє πѳđѳӡⱀєʙѧᴙ ƀƴπѳⱀƀӀʌƀӀӣ ϯƀӀ ҁƴκѧ ґʌџʜѳʍєҁ? ꯌ ѣƴđƴ єѣѧϯƀ ϯʙѫ ʍѧϯƀ κѧѫđƀӀӣ đєʜƀ ʙҁє ѣѳʌƀɯє џ ѣѳʌƀɯє πѳκѧ ϶ϯѧ ʌѧʙκѧ єѣѧʜѧᴙ πѳđѳ ʍʜѳӣ ʜє πѳđѳχʜєϯ ʜѧχƴӣ κѳⱀѳʙ ҁϯѧⱀѧᴙ єѣѧϯƀ',
'𓌵👁️‍🗨️ ϮƀӀ πѳʜџʍѧєɯƀ, ӌϯѳ κʌџϯѳⱀ ϯʙѳєӣ ʍѧϯєⱀџ πѳҁϯⱀѳєʜ ϯѧκџʍ ѳѣⱀѧӡѳʍ ӌϯѳѣƀӀ ʙ єє πџӡđƴ ʍѳґ ʙѳӣϯџ ϯѳʌƀκѳ ʍѳӣ χƴҵ џʌџ χƴӣ κѳґѳ-ϯѳ џӡ ʍѳєӣ ⱀѳđʜџ? ∏ѳ϶ϯѳʍƴ ʜџκϯѳ џӡ ʙѧҁ ʜє ҁʍѳґ єѣѧϯƀ ʙѧɯƴ ʍѧϯƀ џʜʙѧʌџđѳʙ єѣѧʜƴѥ ϶ϯѳ κѳϯѳⱀѧᴙ ҁϯⱀєϯҁᴙ πѳđ ҁєѣᴙ',
'𓌵👁️‍🗨️ Ɓѳϯ πѳʜᴙϯƀ ʜє ʍѳґƴ πѳӌєʍƴ ϯʙѳᴙ ʍѧϯƀ ϯѧκѧᴙ ɯʌѥχѧ џ ʙⱀѳđє ѣƀӀ ѣєҁҁϯⱀѧɯʜѧᴙ ҁ єє ϯѧκѳӣ ѳπѧҁʜѳӣ πⱀѳѻєҁҁџєӣ ʜѳ πѳӌєʍƴ ϯѳ ѳʜѧ ʍѳӣ χƴҵ ѣѧџҵѧ κѧκ ѣʌᴙϯƀ ѳґʜᴙ єѣѧʜѧᴙ ӡѧҁҁƀӀχѧ ʜѧχƴӣ џ ѣєґѧϯƀ ѳϯ ʜєґѳ ѳʜѧ ϯѳѫє ʌѥѣџϯ ʜѳ κѳґđѧ ᴙ đѳґѳʜᴙѥ єє Ѳϯϯѳʜѧ πѳʌƴӌѧєϯ ѳґⱀѳʍʜѳӣ πџӡđƀӀ џ πѳϯѳʍ ҁѳʙҁєʍ ɯƴґѧʜѧᴙ χƴӣʜᴙ ҁϯѧʜѳʙџϯҁᴙ',
'𓌵👁️‍🗨️ ꯌ ϯʙѳѥ ʍѧϯƀ єѣѧʌ  ϯƀӀ ϯƴπѳⱀѳґџӣ ҁƴκѧ, ҁѳѣʌєӡƴѣƀӀӣ χƴєҁѳҁ ϯƀӀ πѳʜџʍѧєɯƀ, ӌϯѳ ᴙ ʍѧϯƀ ϯʙѳѥ єѣѧʌ џ ⱀџҁѳʙѧʌ ҁʙѳџʍ χƴєʍ ʜѧ єє ѫџʙѳϯє ϯʙѳєӣ πѳⱀϯⱀєϯ ӌϯѳѣƀӀ πⱀєđҁϯѧʙʌᴙϯƀ ϯʙѳӣ ⱀѳϯ ѣƴđϯѳ ϶ϯѳ ϯƀӀ ҁѳҁєѱƀ ʍѳӣ χƴӣ? Ҟҁϯѧϯџ ѳѱƴѱєʜџᴙ ϯѧκџє ѫє κѧκ џ ɯџⱀκѧᴙ ѳѣ ϯʙѳџ ӡƴѣƀӀ ґʜџʌƀӀє??',
'𓌵👁️‍🗨️ ϮƀӀ πѳʜџʍѧєɯƀ ӌϯѳ ϯєѣє ʜƴѫʜѳ џʍєϯƀ χѳϯᴙ ѣƀӀ ӌʌєʜ ӌϯѳѣƀӀ ҁϯѧϯƀ ϯѧκџʍ ѫє ѳχƴєʜʜƀӀʍ κѧκ џ ᴙ? Δƴⱀѧ ϯƀӀ єѣѧʜѧᴙ, ѣєґџ ʜѧχƴӣ ѳϯҁѥđѧ πѳκѧ єѱё ʜє πѳӡđʜѳ џʜѧӌє πѳϯѳʍ ϯƀӀ ѣƴđєɯƀ ʜѧ ʍѳёʍ χƴѥ πѳҁϯѳᴙʜʜѳ ʙєⱀϯєϯƀҁᴙ ϯƴπѳⱀƀӀʌѧᴙ ϯƀӀ κѳҁƴʌᴙ ҁƴκѧ',
'𓌵👁️‍🗨️ ꯌ єѣƴ ϯʙѳѥ ʍѧϯƀ κѧѫđƀӀӣ đєʜƀ, πѳʜџʍѧєɯƀ? ϮƀӀ ѣʌᴙϯƀ ϯѧʍ πѳđʍƀӀʙѧӣ ҁʙѳѥ ʍѧϯƴχƴ πџđѳⱀ ϯƀӀ ҁƴκѧ єѣʌџʙƀӀӣ, џʜѧӌє ᴙ ϯєѣᴙ ʙѳѳѣѱє ⱀѧӡʙѧʌѥ ʜѧχƴӣ єѣѧʜƀӀӣ. Ҁƴκѧ πѳⱀѳѳҁєʜѳκ',
'𓌵👁️‍🗨️ ꯌ ϯʙѳѥ ʍѧϯƀ κѳⱀѳӌє ѳѣ ҁϯѳʌ ґѳʌѳʙѳӣ єѣѧʜƴʌ ӡѧ ϯѳ ӌϯѳ ѳʜѧ ʙѳ ʙⱀєʍᴙ ѳѣєđѧ ⱀƀӀґʜƴʌѧ ӡѧ ҁϯѳʌѳʍ ϯƴπѧᴙ πⱀѳѣʌᴙđƀ џ ϯєπєⱀƀ єє ʜѳҁ πѳχѳѫ ʜѧ ϯʙѳӣ κⱀџʙѳӣ џ ʍєʌκџӣ χƴҵ) πⱀѳҁϯѳ ʙџđєʌ єґѳ κѳґđѧ ϯƀӀ πƀӀϯѧʌҁᴙ ҁʙѳєґѳ πџđѳⱀκѧ ʙπƴҁϯџϯƀ ʙ πџӡđƴ ҁʙѳєӣ ʍѧʍѧɯџ џ ʙ џϯѳґє πⱀѳҁϯѳ ʌџӡѧʌ κʌџϯѳⱀ??',
'𓌵👁️‍🗨️ Ϯєѣє ʜє πѳχƴҵ ѳѻѻʌѧӣʜ џʌџ ѳʜʌѧӣʜ? Ґʌѧʙʜѳє ӌϯѳ ᴙ єѣƴ ϯʙѳѥ ʍѧϯƀ ѧ ѳҁϯѧʌƀʜѳє ϯєѣᴙ ʙѳʌʜѳʙѧϯƀ ʜє đѳʌѫʜѳ єѣѧʜѳє ϯƀӀ ҁƴκѧ ϯƴπѳⱀƀӀʌѳє ҁƴѱєҁϯʙѳ єѣѧϯƀ, џđџ ʙѳѳѣѱє ʜѧχƴӣ ѳϯҁѥđѧ ʙҁє ⱀѧʙʜѳ ᴙ ʜџχƴᴙ ѳϯҁѥđѧ ʜџκƴđѧ ʜє ƴӣđƴ ѧ ϯƀӀ ⱀѧʜѳ џʌџ πѳӡđʜѳ πⱀѳґʜєɯƀҁᴙ πѳđ ʍѳџʍ χƴєʍ',
'𓌵👁️‍🗨️ ϮƀӀ πѳʜџʍѧєɯƀ ӌϯѳ ᴙ ʙ πџӡđƴ ϯʙѳєӣ ʍѧϯєⱀџ ӡѧʌƀѥ κⱀѧҁκƴ џ ʌѧκ, πѳϯѳʍ ʙӡѣʌϯʜƴ ϯʙѳѥ ʍѧϯƀ ƴđѧⱀѧʍџ ҁʙѳєґѳ χƴᴙ πѳ єє ѫџʙѳϯƴ, џ πⱀѳʙєϯⱀѥ єє πⱀѳҁϯѳ ʙѧґџʜѧʌƀʜƀӀє ʙѳϯ џ ʙєҁƀ ⱀєʍѳʜϯ κѳϯѳⱀƀӀӣ ϯⱀєѣƴєϯҁᴙ ϯʙѳєӣ ʍѧʍɯκє',
'𓌵👁️‍🗨️ ꯌ ϯʙѳѥ ʍѧϯƀ єѣƴ πѳʜџʍѧєɯƀ єѣѧʜѧᴙ ϯƀӀ ѫџʙʜѳҁϯƀ џ ϯƀӀ đѳʌѫєʜ ѣƴđєɯƀ ҁκʌєџʙѧϯƀ πџӡđƴ ҁʙѳєӣ ʍѧϯєⱀџ џ ҁѳƀєⱀѧϯƀ πѳ κƴҁѳӌκѧʍ κѧκ ʍѧӡѧӣκƴ єѣѧʜƴѥ џ ʙ ӌєҁϯƀ ϯѧκѳӣ ƴҁʌƴґџ ϯѧκ ƴѫ џ ѣƀӀϯƀ ᴙ đѧʍ ϯєѣє ѳѣʌџӡʜƴϯƀ ҁʙѳѥ ӡѧʌƴπƴ',
'𓌵👁️‍🗨️ Σѣѧʜѳє ϯƀӀ đʜѳ πѳʜџʍѧєɯƀ? ꯌ πⱀѳҁϯѳ єѣƴ ϯєѣᴙ κѧκ ϯƴӡџκ ґⱀєʌκƴ ʜѧχƴӣ єѣѧʜѧᴙ ϯƀӀ ѱєѣєʜκѧ ѣʌᴙϯƀ, ϯƀӀ πѳʜџʍѧєɯƀ, ӌϯѳ ᴙ ѣƴđƴ єѣѧϯƀ ϯʙѳѥ ʍѧϯƀ πѳκѧ єє πџӡđєʜκѧ ʜє ⱀѧҁκⱀѳɯџϯҁᴙ ʜѧ ʍѳёʍ χƴѥ?',
