'𓌵👁️‍🗨️ ∏ѳʍʜѥ ʙџđєʌ κѧκ ϯʙѳѥ ҁєʍƀѥ πџӡđџʌџ ѣѳʍѫџ ʜѧ ƴʌџҵє џ ᴙ κѳʜєӌʜѳ ⱀѧӡѳґʜѧʌ ʙҁєχ ʜѳ κѧκ ʙƀӀᴙҁʜџʌѳҁƀ ϯʙѳџ ⱀѳđџϯєʌџ χѳϯєʌџ ѳϯʜᴙϯƀ ƴ ѣєӡđѳʍʜƀӀχ ʜєʍʜѳґѳ єđƀӀ',
'𓌵👁️‍🗨️ ϮƀӀ πѳʍʜџɯƀ ӌϯѳ ʍѳӣ χƴӣ ʙ πџӡđє ϯʙѳєӣ ʍѧϯєⱀџ ӌƴϯƀ ʜє ӡѧѣʌƴđџʌҁᴙ ѳđџʜ ⱀѧӡ? ϮƀӀ єѱё ϯѳґđѧ ѳϯπⱀѧʙџʌҁᴙ ʙ πџӡđƴ ҁʙѳєӣ ʍѧϯƴχџ ʜѧ πѳџҁκџ ʍѳєґѳ χƴᴙ џ ʙ џϯѳґє ϯƀӀ ʙƀӀʙєʌ єґѳ ʜѧ πѳʙєⱀχʜѳҁϯƀ πџӡđƀӀ ϯʙѳєӣ ʍѧʍѧʜџ џ ӡѧ ϶ϯѳ ᴙ ⱀѧӡⱀєɯџʌ ϯєѣє єґѳ ҵѳʍκʜƴϯƀ',
'𓌵👁️‍🗨️ ꯌ ϯʙѳѥ ʍѧϯƀ єѣѧʌ ґѳʙѳⱀѥ ϯєѣє єѱё ⱀѧӡ πѳʜџʍѧєɯƀ ʍєʜᴙ? ϮƀӀ ѣʌᴙϯƀ ҁєӣӌѧҁ đѳʌѫєʜ ѣƴđєɯƀ πⱀџʙѳʌѳӌџϯƀ ҁʙѳѥ ʍѧϯƴχƴ ʜѧ ʍѳӣ χƴҵ ӌϯѳѣƀӀ ᴙ єѱё ⱀѧӡ єє ʙƀӀѣⱀѧʌ ѳκѳʜӌѧϯєʌƀʜѳ đƴʍѧѥ ʜѧ ҁєґѳđʜᴙ џ ҁⱀѧӡƴ ѫє ʜѧ ʍѳӣ χƴӣ ӡѧπⱀƀӀґʜєɯƀ ϯƀӀ',
'𓌵👁️‍🗨️ ꯌ ϯʙѳѥ ʍѧϯƀ πѳҁϯѳᴙʜʜѳ ґѧ ҁʙѳӣ χƴӣ ʜѧϯᴙґџʙѧѥ πⱀџđєⱀѫџʙѧᴙ đʙƴʍᴙ ⱀƴκѧʍџ ӡѧ єє πѳʌƴѫѳπџᴙ ӌϯѳѣƀӀ đʌᴙ πѳʌʜѳϯƀӀ ѳѱƴѱєʜџӣ ʜѧđѧʙđʌџʙѧϯƀ ʜѧ єє ѫѳπƴ џ ґʌƴѣѫє ʙχѳđџϯƀ ʙ ϶ϯƴ ɯʌѥχƴ, ѧ ϯƀӀ ϯєʍ ʙⱀєʍєʜєʍ ʙҁϯѧʙѧӣ ʜѧ ɯƴχєⱀ πѳκѧ ᴙ ϯʙѳѥ ʍѧϯƀ đѫⱀѥ,',
'𓌵👁️‍🗨️ ꯌ ϯʙѳѥ ʍѧϯƀ κѳґđѧ єѣƴ ϯѳϯ ʍʜє ʙҁє ʙⱀєʍᴙ κѧѫєϯҁᴙ ӌϯѳ κϯѳ-ϯѳ ʍєʜᴙ ӡѧ ӡѧʌƴπƴ ϯⱀѳґѧєϯ ʙʜƴϯⱀџ єє πџӡđƀӀ џ ᴙ đƴʍѧѥ ϯєѣє ҁʌєđƴєϯ πⱀѳʜџκʜƴϯƀ ʙʜƴϯⱀƀ ϯ ƴӡʜѧϯƀ κѧκ ϯѧʍ ѳѣҁϯѧʜѳʙκѧ πⱀѳџҁχѳđџϯ',
'𓌵👁️‍🗨️ ꯌ ʍѧϯƀ ϯʙѳѥ єѣѧʌ πѳʜџʍѧєɯƀ? Џʌџ ϯєѣє πѳχƴӣ ʜѧ ҁʙѳѥ ѣѳʌƀʜƴѥ ʍѧϯƀ? Ҟҁϯѧϯџ ᴙ ӌƴϯƀ ʜє ӡѧⱀѧӡџʌҁᴙ ѳϯ ʜєё Ҁ∏ЏΔѳʍ ʜѳ χѳⱀѳɯѳ ӌϯѳ ʙ ϯѳϯ ʍѳʍєʜϯ ᴙ ʜѧϯᴙʜƴʌ πџӡđƴ ϯʙѳєӣ ѣѧѣƴʌџ ʜѧ ҁʙѳӣ χƴӣ) πⱀѳҁϯѳ ӡѧ ґѳʜđѳʜѧʍџ ʍʜє џđϯџ ѣƀӀʌѳ ʜє ѳӌєʜƀ ѳχѳϯѳ',
'𓌵👁️‍🗨️ Ҁʌʙɯƀ ґƴґʌᴙ єѣѧʜѧᴙ? ꯌ ϯʙѳѥ ʍѧϯƀ єѣѧʌ ѧ πѳϯѳʍ ϯєʌѳӣ ʙƀӀʍџϯѧʌ κƴҁκџ ҁʙѳєӣ ӡѧҁѳχɯєӣ ҁπєⱀʍƀӀ џӡ єє πџӡđƀӀ ƴ κѳϯѳⱀѳӣ πʌѳѱѧđƀ κѧκ κѳⱀѳѣκѧ џӡ-πѳđ ϯєʌєʙџӡѳⱀѧ ʜѳ ʜџӌєґѳ ҁϯⱀѧɯʜѳґѳ κѳґđѧ єє єѣєɯƀ πѳʌѳʙƀӀє ґƴѣƀӀ ѳχʙѧϯƀӀʙѧѥϯ χƴӣ џ ѣѳʌєє ʍєʜєє єҁϯƀ ѳѱƴѱєʜџᴙ',
'𓌵👁️‍🗨️ Ҟѳⱀѳӌє ϯʙѳᴙ ʍѧϯƀ ҁєӣӌѧҁ ҁϯѳџϯ ʜѧ κⱀѧѥ ʍѳєґѳ χƴᴙ џ κƴⱀџϯƀ πѳҁʌє ϯѳґѳ κѧκ ᴙ πⱀєđѧʌ єє ҁƴϯκџ џ ϯєπєⱀƀ ᴙ πⱀџʜᴙʌҁᴙ єѣѧϯƀ ϯєѣᴙ πѳ πѳʌʜѳӣ πⱀѳґⱀѧʍʍє, єѣѧʜƀӀӣ ϯƀӀ ҁƴκѧ ӌєӌєʜ',
'𓌵👁️‍🗨️ ꯌ κѳⱀѳӌє ʍѧϯƀ ϯʙѳѥ єѣƴ ʍᴙҁѳ ϶ϯѳ єѣѧʜѳє πѳʜџʍѧєɯƀ? ϮƀӀ ѣʌᴙϯƀ χѳϯƀ πѳʍѳґџ ʍʜє џ џđџ πѳđєⱀѫџ, ӌϯѳѣƀӀ ѳʜѧ ʜє đєⱀґѧʌѧҁƀ џʜѧӌє ϶ϯѳ πⱀџʙєđёϯ κ đѳπѳʌʜџϯєʌƀʜƀӀʍ ϯⱀѧʙʍѧʍ єє πџӡđƀӀ χѳϯᴙ ѳʜѧ џ ϯѧκ ƴѫє ⱀѧӡʙѧʌџʙѧєϯҁᴙ',
'𓌵👁️‍🗨️ ҀʌƀӀɯƀ ґѳʙʜѥ єѣѧʜƀӀӣ? Ϯʙѳё ґʜџѥѱєє ϯєʌѳ ᴙ ӡѧʙѧʌѥ κѧʍʜᴙʍџ πѳҁʌє ϯѳґѳ κѧκ ʙƀӀєѣƴ ϯєѣᴙ πєϯƴχѧ єѣѧʜѳґѳ ӌϯѳѣƀӀ ϯєѣᴙ ʜџκѳґđѧ ѣѳʌƀɯє ʜє ʜѧɯʌџ, ѧ ҁѧʍ ᴙ ѣƴđƴ єѣѧϯƀ ϯʙѳѥ ʍѧϯƀ πѳκѧ ѳʜѧ ʜѧχƴӣ κѳπƀӀϯѧ ʜє ѳϯѣⱀѳҁџϯ',
'𓌵👁️‍🗨️ ϮƀӀ ѣʌᴙϯƀ πƴđєʌƀ ҁϯⱀџѫєʜʜƀӀӣ ϯƀӀ πѳʜџʍѧєɯƀ ӌϯѳ ᴙ єѣѧʌ ϯʙѳѥ ʍѧϯƀ πⱀᴙʍѳ ʜѧ ґʌѧӡѧχ ʙҁєӣ ϯʙѳєӣ ⱀѳđʜџ џ ѳʜџ ҁʍѳϯⱀєʌџ ʜѧ ϯʙѳѥ ʍѧϯƀ ҁ ӡѧʙџҁϯƀѥ џӡ-ӡѧ ϯѳґѳ ӌϯѳ ᴙ єѣƴ џʍєʜʜѳ єє ѧ ʜє κѳґѳ-ϯѳ џӡ ʜџχ',
'𓌵👁️‍🗨️ ϮƀӀ πѳʜџʍѧєɯƀ ӌϯѳ ʍѳӣ χƴӣ χѳⱀѳɯѳ ӡѧӣđєϯ ʙ πџӡđƴ ϯʙѳєӣ ʍѧϯєⱀџ ϯѳʌƀκѳ єҁʌџ ϯƀӀ ѣƴđєɯƀ đѧʍκⱀѧϯѳʍ ⱀѧӡđʙџґѧϯƀ єє πѳʌѳʙƀӀє ґƴѣƀӀ џ ƀӀ ӌєҁϯƀ ѣʌѧґѳđѧⱀʜѳҁϯџ ᴙ đѧʍ ϯєѣє ҁѳҁʜƴϯƀ ҁʙѳєґѳ χƴᴙ',
'𓌵👁️‍🗨️ ꯌ ϯʙѳѥ ʍѧϯƀ ʙӌєⱀѧ πџӡđџʌ ƴєѣᴙ ʙ πѳđъєӡđє ӡѧ ϯѳ ӌϯѳ ѳʜѧ ʜѧҁҁѧʌѧ ʙ ƴґʌƴ ѧ πѳϯѳʍ ʙƀӀɯєʌ ҁѳҁєđ πѳ ʌєҁϯʜϯʜѳӣ κʌєϯκє џ ӡѧϯƴɯџʌ ѣƀӀӌѳκ ѳѣ єє πџӡđƴ џ ʍƀӀ ҁ ʜџʍ ҁπƴҁϯџʌџ ϶ϯƴ ɯʌѥχƴ ҁ ʌєҁϯʜџҵƀӀ πʜƴʙ πѳđ πџӡđƴ',
'𓌵👁️‍🗨️ ϮƀӀ ѣʌᴙϯƀ ɯєʌƴχѧ єѣѧʜѧᴙ ҁ πџӡđƀӀ ҁʙѳєӣ ʍѧʍѧɯџ κѳϯѳⱀƴѥ ᴙ χƴєʍ ѳϯɯџѣѧʌ κѧκ χʌѳπƴɯκѳӣ џ ϯєπєⱀƀ ϯєѣᴙ ʜƴѫʜѳ ʙƀӀκџʜƴϯƀ ʙ ʍƴҁѳⱀκƴ џӡ-ӡѧ ʜєπⱀџґѳđʜѳҁϯџ ʙ κѧκѳʍ-ʌџѣѳ ʙџđє??',
'𓌵👁️‍🗨️ ꯌ ϯʙѳѥ ʍѧϯƀ χƴєʍ ӡѧҵєπџʌ ӡѧ ɯєѥ џ ʙѳđџʌ ӡѧ ҁѳѣѳӣ κѧκ єѣѧʜƴѥ ҁѳѣѧκƴ κѳϯѳⱀѧᴙ πѳҁʌƴɯʜѳ ʙƀӀπѳʌʜᴙʌѧ ʍѳџ κѳʍѧʜđƀӀ џ đѧѫє ҁѳҁѧʌѧ ʍѳӣ χƴӣ џ ʍѳґʌѧ đѧϯƀ ʙ ѳӌκѳ πѳєѣѧϯƀ єє ʙ ʌѥѣѳʍ ʍєҁϯє',
'𓌵👁️‍🗨️ ϮƀӀ πѳʜџʍѧєɯƀ ӌϯѳ ʍѳӣ χƴӣ ʙ πџӡđє ϯʙѳєӣ ʍѧϯєⱀџ πѳҁϯѳᴙʜʜƀӀӣ κʌџєʜϯ џ єʍƴ ʙƀӀđѧʌџ ϯѧʌѳʜ ʜѧ đѳπѳʌʜџϯєʌƀʜƀӀє ӌѧҁƀӀ єѣʌџ ҁ ϯʙѳєӣ ʍѧϯєⱀƀѥ',
'𓌵👁️‍🗨️ ꯌ ϯʙѳѥ ʍѧϯƀ єѣƴ κѧѫđƀӀӣ đєʜ џ єє πџӡđѧ ƴѫє ѣѳʌєє ʍєʜєє ʜѧӌѧʌѧ πⱀџʙƀӀκѧϯƀ κ ʍѳєʍƴ χƴѥ џ ϯєπєⱀƀ ᴙ ƴѫє ʍѳґƴ єѣѧϯƀ єє ҁ ѣѳʌƀɯєӣ ҁκѳⱀѳҁϯƀѥ πѳ϶ϯѳʍƴ ϯєѣє πⱀџđёϯҁᴙ ʜѧ ʙҁᴙκџӣ ҁʌƴӌѧӣ πѳҁϯѳᴙϯƀ ʜѧ ɯƴχєⱀє',
'𓌵👁️‍🗨️ ϮƀӀ πѳʜџʍѧєɯƀ ӌϯѳ ϯʙѳᴙ ʍѧϯƀ єѣѧʜѧᴙ κѳʌƀӀʍѧґѧ џ ᴙ ҁʙѳӣ χƴӣ ʙʙѳѫƴ ʙ єє πџӡđƴ ʜѧ ϯєʌєґє ӌϯѳѣƀӀ ѳʜѧ ѣєӡ ѳҁϯѧʜѳʙѳκ πѧʌ ҁⱀѧӡƴ ѫє џʍєʜʜѳ ʙ ᴙӣҵєκʌєϯκƴ џ ѳϯʌѳѫџʌ ϯѧʍ ҁʙѳєӣ ҁπєⱀʍƀӀ đʌᴙ ⱀѧӡѳđƀӀɯѧ κѳϯѳⱀƀӀӣ ʙ πѳҁʌєđҁϯʙџџ ҁϯѧʜєϯ ϯѧκџʍ ѫє ʍѳџʍ ʌџӌʜƀӀʍ χƴєҁѳҁѳʍ κѧκ џ ϯƀӀ',
'𓌵👁️‍🗨️ ҀʌƀӀɯƀ єѣѧϯƀ ϯƀӀ πџđѳⱀ đєκѳⱀѧϯџʙʜƀӀӣ, ϯƀӀ πѳʜџʍѧєɯƀ, ӌϯѳ ʍѧϯƀ ϯʙѳᴙ ҁ ʍѳєґѳ χƴᴙ ʙѳѳѣѱє ʜє ƴχѳđџϯ ʜџχƴᴙ џ ʍʜє πⱀџχѳđџϯҁᴙ χƴєʍ ʌƴπџϯƀ єӣ πѳ ґѳʌѳʙє ӌϯѳѣƀӀ ϶ϯѧ ɯѧʙκѧ єѣѧʜѧᴙ ƴɯʌѧ ʜѧχƴӣ џ ʜє ʍєɯѧʌѧҁƀ ґѧ ʍѳёʍ πƴϯџ ѧ ϯѳ џӡ-ӡѧ ʜєё ѳđʜџ ʜєπⱀџᴙϯʜѳҁϯџ ҁѳ ʍʜѳӣ ҁʌƴӌѧʌџҁƀ',
'𓌵👁️‍🗨️ Ҟѳⱀѳӌє ᴙ єѣѧʌ ϯʙѳѥ ʍѧϯƀ ʙѳ ʙⱀєʍᴙ єє ʍєҁᴙӌʜƀӀχ џ κⱀѳʙƀ χʌƀӀҁϯѧʌѧ џӡ єє πџӡđƀӀ ѣƴđϯѳ ᴙ χƴєʍ ʙєʜƴ ʙҁκⱀƀӀʌ єӣ џ ӌϯѳѣƀӀ ѳҁϯѧʜѳʙџϯƀ κⱀѳʙѳϯєӌєʜџє ʍʜє πⱀџɯʌѳҁƀ ӡѧѣџϯƀ ʙ єє πџӡđƴ ѣѳʌƀɯƴѥ đƴѣʌѥ πⱀѳѣκƴ',
'𓌵👁️‍🗨️ Ҁʌʙɯƀ ʜѧχƴӣ єѣѧʌđƴӣ ϯƀӀ єѣѧʜƀӀӣ πѳɯёʌ ʜѧχƴӣ ѳϯҁѥđѧ πѳκѧ ҁʙѳџʍ χƴєʍ ʜє πⱀѳѣџʌ ѧʜѧʌƀʜƀӀє ӡѧґⱀѧѫđєʜџᴙ ϯʙѳєӣ ʍѧʍѧɯџ џ ʜє πⱀѳχƴᴙⱀџʌ πⱀѳѣѳџʜƴ ʙ єє ʍѧϯκє ӌϯѳѣƀӀ ѣʌᴙϯƀ џӡѣєѫѧϯƀ ⱀѳѫđєʜџᴙ ϯѧκџχ єѣѧʜƀӀχ πџđѳⱀѧҁѳʙ ʙⱀѳđє ϯєѣᴙ єѣʙѧʜѳґѳ χƴєґʌѳϯѧ ѣʌᴙϯƀ џđџ ʜѧχƴӣ ѳϯҁѥđѧ ʙ ʜѧϯƴⱀє ⱀѧӡʙѧʌѣѥ ϯєѣᴙ κѧκ πєҁѳӌʜƴѥ ѻџґƴⱀƴ ҁƴκѧ',
'𓌵👁️‍🗨️ ꯌ ϯʙѳѥ ʍѧϯƀ єѣѧʌ ʙ ґʌѳϯκƴ єє єѣѧʜƴѥ џ ҁʌƴӌѧӣʜѳ πⱀѳѣџʌ ҁʙѳџʍ χƴєʍ єє ѱєκƴ єѣʌџʙƴѥ ҁƴκѧ πџđѳⱀѧҁѧ ϯƀӀ κƴҁѳκ ʜѧχƴӣ, ᴙ ѫє ѣʌᴙϯƀ ʙ ʜѧϯƴⱀє ϯєѣє ѣѧӡѧⱀƀӀ ӌϯѳ ʍѧϯƀ ϯʙѳᴙ ѻπʜѧϯєє ѳϯ ʍѳєґѳ χƴᴙ џ ѳʜѧ ѣƴđєϯ ҁѳҁѧϯƀ єґѳ ʙҁєґđѧ',
'𓌵👁️‍🗨️ Ϯʙѳӣ đєđ ѣƀӀʌ ѧʜѧʌƀʜƀӀʍ ґєⱀѳєʍ ҁѳʙєϯҁκѳґѳ ҁѳѥӡѧ џѣѳ ѳʜѧ ҁʙѳєӣ đѳʍѳӣ ⱀѳđџʜƴ ӡѧѱџѱѧʌ ʜѧ đʙѧ ѻⱀѳʜϯѧ џ ʙ ӌєҁϯƀ πѳѣєđƀӀ єʍƴ ʙⱀƴӌџʌџ κѳπџѥ ʍѳєґѳ χƴᴙ ѳƀʍѳϯѧʜʜƴѥ ґєѳⱀґџєʙҁκѳӣ ʌєʜϯѳӌκѳӣ',
