'⽍🇰🇼 〞 რᤜჿꤎ ოձრ᥇ ნ᥈ձᤇჿმձթꤎ ოჿᤉოყ ᥊ყდ ꤊձա᥈ձ მჿթჿᤇყ ᥌ ᥈ᤉ᥌ձ)〝 🇰🇼⽍',
'⽍🇰🇼 〞 რ᥏ ნ᥈ꤎრ᥇ იჿꤊսოձᤉա᥇ վრჿ ოჿմ ᥊ყմ ϶რჿ ҟձҟ მ𐌟ი᥌ ꤊձաᤉ᥈ იսვმձҟ რᤜჿᤉմ ოձრᤉթս ᤜ ձრ᥈ձꤊრսმᤉ)〝 🇰🇼⽍',
'⽍🇰🇼 〞 რ᥏ ნ᥈ꤎრ᥇ იჿꤊսოձᤉա᥇ վრჿ იսვმձҟ რᤜჿᤉմ ოձრᤉթս რձҟ მჿ᥈ᤇჿ ꤊᤉ ᤉნձ᥈ս վრჿ რձო ҟթ᥏᥌᥏ ვձᤜᤉ᥈ս᥌᥇)〝 🇰🇼⽍',
'⽍🇰🇼 〞 ოჿմ ᥊ყմ ϶რჿ ᤇᤉꤊᤉթձ᥈ იսვმ᥏ რᤜჿᤉմ ოձრᤉթս)〝 🇰🇼⽍',
'⽍🇰🇼 〞 რᤜჿꤎ ოձრ᥇ ꤊձ᥊ყմ ꤊձმᤉ᥈ձ ყաս მ᥇ꤎᤜჿ᥈ձ ꤊձ ოჿմ ᥊ყմ?)〝 🇰🇼⽍',
'⽍🇰🇼 〞 ꤎ աձ რᤜჿდ ოձრ᥇ ᥌იყաყ ᥌ჿ ᥌ᤜჿᤉᤇჿ ᥊ყꤎ ҟձҟ მᤉრᤉմ ᥌ ᤇჿթҟս)〝 🇰🇼⽍',
'⽍🇰🇼 〞 რᤜჿꤎ ოձრ᥇ ꤊձ᥊ყմ ოჿմ ᥊ყմ იჿᤜᤉ᥌ս᥈ձ ᥌ყասრ᥇ იჿ᥌᥈ᤉ რჿᤇჿ ҟձҟ ჿꤊ ᤉё ᤜ᥏ᤉნձ᥈ ?)〝 🇰🇼⽍',
'⽍🇰🇼 〞 რᤜჿꤎ ოձრ᥇ ᥌ᤜჿսო იսვმձҟჿო ᥌იձოսრ ოჿմ ᥊ყմ)〝 🇰🇼⽍',
'⽍🇰🇼 〞 რᤜჿꤎ ოձრ᥇ ꤊձ᥊ყմ ᤜ ოჿմ ᥊ყմ მყꤊყ᥈ձ ҟձҟ ᤜ ჶ᥈ᤉմრყ ?)〝 🇰🇼⽍',
'⽍🇰🇼 〞 რᤜჿꤎ ოձრ᥇ ᥌ყҟձ ᤜ᥏ვ᥏ᤜձᤉრ ᤜოᤉ᥌რჿ ᥌ҟჿթჿմ ოჿմ ᥊ყմ)〝 🇰🇼⽍',
'⽍🇰🇼 〞 რ᥏ ნ᥈ꤎრ᥇ იჿꤊսოձᤉա᥇ վრჿ ꤎ რᤜჿდ ოձრ᥇ աձ ᥌ҟսꤊყ ᥌ჿ ᥌ᤜჿᤉᤇჿ ᥊ყꤎ ս ꤊձმᤉꤊყ რᤜჿდ ᥌ᤉ᥌რթყ ჿꤊձ ნყმᤉრ ꤊჿᤜ᥏ო ասრჿო მ᥈ꤎ ოჿᤉᤇჿ ᥊ყꤎ)〝 🇰🇼⽍',
'⽍🇰🇼 〞 ꤎ ꤊձ იսვმձҟᤉ რᤜჿᤉմ ოձრᤉթս ᥌ձრձꤊყ ᥌ᤜჿսო ᥊ყᤉო ᤜ᥏ვ᥏ᤜձრ᥇ ꤊձվꤊყ ҟჿᤇმձ მჿᤉნყ ᤉᤉ მჿ ᥌ოᤉթრս)〝 🇰🇼⽍',
'⽍🇰🇼 〞 ꤎ რᤜჿდ ოձრ᥇ ნყმყ ᤉნձრ᥇ მჿ რձҟჿմ ᥌რᤉიᤉꤊս , վრჿ ყ ꤊᤉᤉ ᥌ყმჿթჿᤇձ ꤊձվꤊᤉრ᥌ꤎ ս ჿꤊձ ჿრҟսꤊᤉრ᥌ꤎ ꤊձ ოჿᤉო ᥊ყდ)〝 🇰🇼⽍',
'⽍🇰🇼 〞 ꤎ რᤜჿდ ოձრ᥇ რձҟ ᤉნձ᥈ վრჿ ყ ꤊᤉё იսვმձ ᤜვ᥈ᤉრᤉ᥈ձ ᤜ ᤜჿვმყ᥊)〝 🇰🇼⽍',
'⽍🇰🇼 〞 ꤎ რᤜჿდ ოձრ᥇ ᥌ყҟձ ꤊձ ᤇჿթձ᥊ ᤉნձ᥈ იჿრჿო ᤉё ᥌ҟսꤊყ᥈ ᥌ ᤇჿթ᥏ ҟձҟ ҟჿ᥈ჿნҟձ)〝 🇰🇼⽍',
'⽍🇰🇼 〞 ꤊձ᥊ყմ რᤜჿꤎ ოձრ᥇ მձᤉრ ოჿᤉოყ რձნ᥈ᤉრҟყ սნყიթჿჶᤉꤊ იᤉթᤉმ რᤉო ҟձҟ ᥌ჿ᥌ձრ᥇ ?)〝 🇰🇼⽍',
'⽍🇰🇼 〞 ꤎ რᤜჿᤉմ ოձრᤉթս ვձաս᥈ ᥌ᤜჿսო ᥊ყᤉო ყաս ձ რჿ սꤊჿᤇმձ რձҟ ᤉნձասრ ოჿꤎ ᥌იᤉթოձ ᥌ ყա რᤜჿᤉմ ოձრᤉթս ҟձҟ ᥌ ա᥈ձꤊᤇձ ᤜჿმձ)〝 🇰🇼⽍',
'⽍🇰🇼 〞 რ᥏ იჿꤊսოձᤉա᥇ վრჿ რᤜჿꤎ ოձრ᥇ ꤊձნսթձᤉრ ꤊჿრ᥏ ꤊձ ოჿᤉო ᥊ყდ ᥌ᤜჿսო იսვმձҟჿო?)〝 🇰🇼⽍',
'⽍🇰🇼 〞 რᤜჿꤎ ოձრ᥇ ᥌ᤜჿսო იսვმձҟჿო ᥌იձოսრ ოჿմ ᥊ყմ)〝 🇰🇼⽍',
'⽍🇰🇼 〞 რᤜჿꤎ ოձრ᥇ ᥌ყҟձ ᥌რթձყ᥌ ᤉნձꤊ᥏մ ҟჿრჿթ᥏մ იթꤎվᤉრ᥌ꤎ ᤜ ოჿᤉო ᥊ყᤉ)〝 🇰🇼⽍',
'⽍🇰🇼 〞 რ᥏ ნ᥈ꤎრ᥇ იჿꤊսოձᤉա᥇ վრჿ იսვმձҟ რᤜჿᤉմ ოձრᤉթս ვձասաձᤉრ ოჿմ ᥊ყմ ჿრ ᥌ჿ᥈ꤊᤉվꤊჿᤇჿ ყმձթձ ?)〝 🇰🇼⽍',
'⽍🇰🇼 〞 ꤎ ᥌ᤜჿսო ᥊ყᤉო ყҟթ᥏ᤜձ᥈ რᤜჿᤉմ ოձრᤉթս ᤇჿ᥈ჿᤜყ վრჿნ ყ ꤊᤉմ ꤊᤉ ნ᥏᥈ჿ ᥌ჿ᥈ꤊᤉվꤊჿᤇჿ ყმձթձ ꤊձ 𐌟ձթᤉ)〝 🇰🇼⽍',
'⽍🇰🇼 〞 რᤜჿꤎ ოձრ᥇ ყნᤉᤇձ᥈ձ ჿრ ოჿᤉᤇჿ ᥊ყꤎ ҟձҟ ҟჿ᥈ჿნჿҟ ჿრ ნձნყաҟս ս მᤉმყաҟս)〝 🇰🇼⽍',
'⽍🇰🇼 〞 იսვმձҟ რᤜჿᤉմ ოձრᤉթս ϶რჿ ҟձҟ թձმսჿ ᤜ᥏աҟձ მ᥈ꤎ ოჿᤉᤇჿ ᥊ყꤎ)〝 🇰🇼⽍',
'⽍🇰🇼 〞 ꤊձ᥊ყմ რᤜჿꤎ ოձრ᥇ ყҟթ᥏ᤜձ᥈ձ ოჿմ ᥊ყմ ᥌ᤜჿᤉմ იսვმჿմ ҟჿᤇმձ ოᤉრᤉჿթսრ᥏ იձმձ᥈ս?)〝 🇰🇼⽍',
'⽍🇰🇼 〞 რ᥏ იჿꤊսოձᤉա᥇ վრჿ ꤎ աձ᥌ ᤉნꤊყ რᤉნᤉ იჿ ᤇჿ᥈ჿᤜᤉ ᥊ყᤉო ս რ᥏ թձვᤜձ᥈սա᥇᥌ꤎ ҟձҟ ҟձթრჿվꤊ᥏մ მჿოսҟ?)〝 🇰🇼⽍',
'⽍🇰🇼 〞 რ᥏ იჿ᥌ᤉ᥈ս᥈᥌ꤎ ꤊձ ოჿᤉო ᥊ყდ ս ᥌վսრձᤉա᥇ վრჿ რᤉნᤉ ᤜ᥌ᤉ ოჿ𐌟ꤊჿ, ꤎ რᤉნꤎ աձ᥌ ნ᥏᥌რթჿ ꤊձ᥊ყմ ᥌ҟսꤊყ ჿრ რყმձ)〝 🇰🇼⽍',
'⽍🇰🇼 〞 რ᥏ იჿꤊսოձᤉա᥇ վრჿ ꤎ աձ᥌ ᥊ყᤉო რթꤎ᥌ձꤊყ რᤜჿꤎ ოձრ᥇ იթჿ᥌ꤊᤉრ᥌ꤎ?)〝 🇰🇼⽍',
'⽍🇰🇼 〞 რ᥏ იჿꤊսოձᤉա᥇ վრჿ ꤎ რᤜჿდ ოձრ᥇ ნყმყ ᤉნձრ᥇ მჿ რձҟჿմ ᥌რᤉიᤉꤊս վრჿ ჿꤊձ ნ᥈ꤎრ᥇ ս᥌᥊ყმձᤉრ ꤊձ ოჿᤉო ᥊ყდ?)〝 🇰🇼⽍',
'⽍🇰🇼 〞 ꤎ რᤉნᤉ աձ᥌ ᤜრჿթჿմ ᤇ᥈ձვ ᤜ᥏ნ᥇დ, რჿ᥈᥇ҟჿ ꤊᤉ ҟყ᥈ձҟჿო ҟձҟ რᤉნᤉ ჿრᤉև ᤜ მᤉრ᥌რᤜᤉ, ձ ᥊ყᤉო)〝 🇰🇼⽍',
'⽍🇰🇼 〞 ꤎ 𐌟ᤉ იᤉթᤉმ რᤉო ҟձҟ ᤜ᥏ᤉნձრ᥇ რᤜჿდ ოձრ᥇ რᤜჿսო ᤉნձ᥈ჿო թձვᤇჿꤊꤎ᥈ ᤜաᤉմ ჿრ ꤊᤉᤉ იսვმձҟձ〝 🇰🇼⽍',
'⽍🇰🇼 〞 ҟჿᤇმձ ოჿմ ᥊ყմ ᤜჿաᤉ᥈ ᤜ թჿრ რᤜჿᤉմ ოձრᤉթս, ჿꤊձ მձ𐌟ᤉ ჿꤊᤉოᤉ᥈ձ ꤊձ᥊ყմ〝 🇰🇼⽍',
'⽍🇰🇼 〞 რ᥏ იჿꤊսოձᤉա᥇ վრჿ ꤎ ꤊձ იսვმձҟᤉ რᤜჿᤉմ ოձრᤉթս ნყმყ սᤇթձრ᥇ ᥊ყᤉო ҟձҟ ꤊձ ნձ᥈ձ᥈ձմҟᤉ?)〝 🇰🇼⽍',
'⽍🇰🇼 〞 ꤎ იսვმձҟ რᤜჿᤉմ ოձრᤉթս ᥊ყᤉო იթჿթձნჿრձ᥈ რձҟ վრჿ ჿꤊ ყ ꤊᤉᤉ ყ𐌟ᤉ ҟձҟ ნձꤎꤊ〝 🇰🇼⽍',
'⽍🇰🇼 〞 რ᥏ იჿꤊսოձᤉա᥇ վრჿ რᤜჿꤎ ოձრ᥇ ოჿսო ᥊ყᤉო იսვმձҟ ᥌ᤜჿմ იჿმრսթձᤉრ?)〝 🇰🇼⽍',
'⽍🇰🇼 〞 ꤎ რᤜჿდ ოձრ᥇ იթս ᤇթჿვᤉ ნყმყ ᤉნձრ᥇ , ჿꤊձ ᥌ ოჿսო ᥊ყᤉო ꤊᤉ վᤉᤇჿ ꤊᤉ ნჿսრ᥌ꤎ)',
'⽍🇰🇼 〞 ꤎ რᤜჿდ ოձრ᥇ աձ᥌ թձ᥌რթᤉ᥈ꤎდ ᥌ ᥊ყꤎ ᥌იᤉթოձҟჿო 〝 🇰🇼⽍',
'⽍🇰🇼 〞 რ᥏ იჿꤊսოձᤉա᥇ վრჿ იսვმձҟ რᤜჿᤉմ ოձრᤉթս იթჿმձᤉრ᥌ꤎ ᤜ ᤇჿ᥌რթձꤊჿოᤉ ვձ მᤉաᤉᤜҟყ?)〝 🇰🇼⽍',
'⽍🇰🇼 〞 იჿվᤉოყ ҟჿᤇმձ ꤎ მჿᤉნ᥏ᤜձდ რᤜჿდ ოձრ᥇ ჿꤊձ რթձᤜսრ რᤜჿմ թჿრ ꤊձ ოჿմ ᥊ყմ?)〝 🇰🇼⽍',
'⽍🇰🇼 〞 რᤜჿꤎ ოձრ᥇ ოჿսო ᥊ყᤉო ვձრꤎᤇսᤜձᤉრ᥌ꤎ, იթꤎო ҟձҟ რᤜჿմ ჿრᤉև ᥌սᤇձթᤉრձოս〝 🇰🇼⽍',
'⽍🇰🇼 〞 ҟჿᤇმձ რᤜჿꤎ ოձოձաձ ოჿսო ᥊ყᤉო սᤇթձᤉრ ᤜ ꤊձ᥌რჿ᥈᥇ꤊ᥏ᤉ սᤇթ᥏, რ᥏ ვձվᤉო ოꤊᤉ ᥊ყմ ᥌ჿ᥌ᤉա᥇?)〝 🇰🇼⽍',
'⽍🇰🇼 〞 ꤎ ოჿᤇყ ᤉნձრ᥇ რᤜჿდ ოձრ᥇ ꤊձ ꤊᤉᤜᤉმჿოჿო ჿრ᥌რթჿᤜᤉ〝 🇰🇼⽍',
'⽍🇰🇼 〞 მձᤜձմ սვ რᤜჿᤉᤇჿ ᥈սևձ ᤜ᥏թᤉ𐌟սო ҟყ᥌ჿվᤉҟ ҟჿ𐌟ս ս ᥌მᤉ᥈ձᤉო սვ ꤊᤉᤇჿ იթսვᤉթᤜձრսᤜ?〝 🇰🇼⽍',
'⽍🇰🇼 〞 რ᥏ ვձᤉნձ᥈ ოꤊᤉ ᤜ᥌ձ᥌᥏ᤜձრ᥇, ꤎმჿნ᥇დ რᤜჿմ թჿრ მჿ ҟჿꤊևձ რ᥏ ნყმᤉա᥇ ყოჿ᥈ꤎრ᥇ վრჿ ნ᥏ ꤎ რձმ რᤉნᤉ ᥌ჿ᥌ձრ᥇)〝 🇰🇼⽍',
'⽍🇰🇼 〞 რᤜჿꤎ ოձოձաձ ҟჿᤇმձ ᥌მჿ᥊᥈ձ ᥊ყ᥈ս რ᥏ ოꤊᤉ ᤜ ᥊ყմ ꤊ᥏᥈?〝 🇰🇼⽍',
'⽍🇰🇼 〞 ᤉნձ᥈ რᤜჿდ ოձრ᥇ ᤜ 𐌟ჿიყ იჿҟձ რ᥏ ოꤊᤉ ᥊ყմ ᥌ჿ᥌ձ᥈)〝 🇰🇼⽍',
'⽍🇰🇼 〞 ᥌᥏ꤊ ᥌ჿნձҟս ᥌᥈᥏ա᥇ მჿ᥈ნձꤊყრձꤎ սმս ჿრ᥌დმձ ս ოձოҟყ ᥌ᤜჿდ იթս᥊ᤜձრս〝 🇰🇼⽍',
'⽍🇰🇼 〞 ҟჿᤇმձ რᤜჿմ იձიձ ᥌რձ᥈ թձҟჿო թყ᥌᥌ҟսմ ჿ᥊ჿრꤊսҟ ᤜ᥏᥌რթᤉ᥈ս᥈ ᤉოყ ᤜ ձꤊձ᥈ ᥌ թყ𐌟᥇ꤎ იթսꤊꤎᤜ ᤉᤇჿ ვձ ᥈ჿ᥌ꤎ〝 🇰🇼⽍',
'⽍🇰🇼 〞 რ᥏ იჿꤊսოձᤉա᥇ վრჿ ꤎ ᤜ᥏ნս᥈ ᥌ᤜჿսო ᥊ყᤉო ᤇ᥈ձꤊმ᥏ რᤜჿᤉմ ოձოձաҟս?)〝 🇰🇼⽍',
